(11, 'Julie', 'van Kampen', '', 'Whistler', '', '', '604-935-0823', 'ja_vankampen@hotmail.com', 'Hi!\r\n\r\nI have a free golf lesson booked on Thursday, May 7th at 4:30 pm - I am wondering if I can change the time to earlier that day, or if I could move it to Wednesday if possible.  If you could get back to me at your earliest convienience, it would be greatly appreciated!\r\n\r\nAlso, I''m wondering if you are currently selling the discounted driving range pass (the punch card).\r\n\r\nThank you!\r\n\r\nJulie', '2009-05-05 20:06:56', '2009-05-05 20:06:56'),
(12, 'Marliss', 'Thiessen', '#1005-283 Davie Street', 'Vancouver', 'BC', 'V6B 5T6', '604-899-4256', 'thiessen.m@novuscom.net', 'Hi Whistler,\r\nWe are excited that it is golf season again!!  I tried to login with my players club user name and password but it rejected me because my email has changed.  Can you send me an email letting me know if I can obtain a booking for 2 this Saturday around 8:00 am.  Otherwise, you can just ensure that my username and password are still valid and I will try loging on again.  Thanks for your help.\r\nMarliss & Brian Thiessen :)', '2009-05-07 03:09:51', '2009-05-07 03:09:51'),
(13, 'Marliss', 'Thiessen', '#1005-283 Davie Street', 'Vancouver', 'BC', 'V6B 5T6', '604-899-4256', 'thiessen.m@novuscom.net', 'Hi Whistler,\r\nWe are excited that it is golf season again!!  I tried to login with my players club user name and password but it rejected me because my email has changed.  Can you send me an email letting me know if I can obtain a booking for 2 this Saturday around 8:00 am.  Otherwise, you can just ensure that my username and password are still valid and I will try loging on again.  Thanks for your help.\r\nMarliss & Brian Thiessen :)', '2009-05-07 03:10:01', '2009-05-07 03:10:01'),
(14, 'PAULINE', 'SHERRATT', '', '', '', '', '', 'pauline.sherratt@travelcounsellors.com', 'Can you please email me details of golf charges and packages with other courses.  I have some clients coming to Whistler in August and they want to book before they arrive.\r\n\r\nMany thanks  Pauline', '2009-05-07 14:58:02', '2009-05-07 14:58:02'),
