(21, 'Graham', 'Colvin', '23 Wayside Crescent', 'Harrogate', 'North Yorkshire', 'HG2 8NJ', '+447775793212', 'g_w_colvin@hotmail.com', 'I am in Whistler at the back end of June and woudl like an 18 hole playing lesson on one day between the 17th and 19th of June.  Please can you let me know if this is possible during those days and whether the $350 includes club hire etc.\r\n\r\nPlease can you let me know what days it would be possible to have the lesson - if it could be as early as possible in the morning (say 7.30 - 8am), that would be brilliant.\r\n\r\nThank you very much in advance.\r\n\r\nKind regards\r\n\r\nGraham Colvin', '2009-05-25 18:02:16', '2009-05-25 18:02:16'),
