(27, 'Christen', 'Thomas', '', '', '', '', '902-421-7022 ext 216', 'formac.production@formac.ca', 'Good morning.\r\nFormac Publishing is working on a new edition of the Vancouver, Victoria & Whistler Colourguide travel book for fall of 2009 in time for the Winter 2010 Olympic games. We have selected Whistler Golf Club to be included in the text and are looking for a recent high resolution visual (e.g. http://www.golfwhistler.com/images/gallery/nicklaus/nicklaus3_lg.jpg from your website) to use in the book. We require 300 dpi of about 4 x 6" or better and can accept files by email (formac.production@formac.ca) or ftp (ftp://ftpclient@ftp.formac.ca, user: ftpclient, password: avro). Our deadline to receive images is June 15th. We will include a photo credit to the photographer and send a copy of the book upon publication. Please let us know if you have an image available for use and what information you require from us.\r\n \r\nThanks,\r\n \r\nChristen Thomas\r\nFormac Publishing\r\nformac.production@formac.ca\r\nwww.formac.ca\r\nph 902.421.7022 x 216\r\nfax 902.425.0166 \r\n\r\n\r\n', '2009-06-08 15:52:46', '2009-06-08 15:52:46'),
(28, 'Alfonso', 'Torres', '4560 Kingsway', 'Burnaby', 'BC', 'V5H 2B1', '778 239 18 11', 'info@alavista.ca', 'Professional Floral Decoration Services $20.00/hour, Auction prices flower sale.\r\n\r\nBuy from your prefered flower wholesaler and leave the decoration to us, or  let us get the best price and the freshest flowers buying them for you at the United Flower Growers Auction, 6 AM Monday, Tuesday and Thursday.\r\n\r\n\r\nVisit our website for more information: www.alavista.ca\r\n\r\nRegards,\r\n\r\nLuciana Magalhaes & Alfonso Torres\r\nProfessional Floral Designer\r\n\r\nmail: info@alavista.ca\r\n\r\nph. 604-288-4049\r\ncell 778-239-1811\r\n\r\n', '2009-06-08 20:07:50', '2009-06-08 20:07:50'),
(29, 'Gim', 'Herbert', '1035 Clyde Ave', 'West Vancouver', 'BC', 'V7T 1E3', '604-926-4169', 'gimherbert@yahoo.com', 'I could not find my #9 Big Bertha golf club after playing at Whistler Golf Club, on Thursday, June 4th, 2009 morning. I am wondering you can check with your ''lost and found'' department for me please to see whether some angels have found it?\r\nMany thanks for your help and I look forward to hearing from you.\r\nGim Herbert ', '2009-06-08 20:31:43', '2009-06-08 20:31:43'),
(30, 'Melissa', 'Conzatti', '', 'Vancouver', 'BC', '', '604-831-3487', 'mconzatti@lindt.com', 'I would like to be contacted by someone who works with pastry/desserts at your location.  I am the Lindt Chocolate Western Canada territory manager and would like to see if Lindt Chocolate can find a place within your dessert and chocolate offerings in your club.  Please have the appropriate contact follow up with me either via email or direct at 604-831-3487.  I am visiting with our Lindt technical advisors and chocolatiers Dominique and Cindy Duby on June 16th and would love to set up an appointment to discuss chocolate!  Thank-you for your time and consideration.\r\n\r\nSincerely,\r\n\r\nMelissa Conzatti', '2009-06-10 19:15:38', '2009-06-10 19:15:38'),
(31, 'Brandon', 'Smith', '2914 NW 85th St', 'Seattle', 'WA', '98117', '', 'mrhistoryguy@yahoo.com', 'I''ll be coming up in August for a few days and would like to play your course.  I have a 2-for-1 coupon, and would like to reserve a tee time, but don''t want to get charged the full ammount.\r\n\r\nCan you help me?', '2009-06-17 00:04:02', '2009-06-17 00:04:02'),
(32, 'DAN', 'ELFORD', '13088 LINTON WAY', 'SURREY', '', 'V3W 5W4', '6045975153', 'dgelford@telus.net', 'what is the special pricing for being involved in the whistler all-star tourney...thx dan', '2009-06-17 03:36:01', '2009-06-17 03:36:01'),
(33, 'Steven', 'Hann', '2 Kappler Crt', 'Glengowrie', 'Australia', '5044', '+61403015460', 'stevenphau@yahoo.com.au', 'Hi, we are visiting Whistler ( from Australia )as part of the upcoming World Police and Fire Games in August. We were wondering if we could get a practice round in on Monday the 3rd August during the afternoon? What are the green fees for 2 players?\r\n\r\nThanks\r\nSteve', '2009-06-17 04:48:44', '2009-06-17 04:48:44'),
(34, 'lucy', 'monte-lisi', '', '', '', '', '', 'lucy.monte-lisi@mlsca.ca', 'We are interested in the Nike Junior Golf School (camp 3) from July 27th to July 30th.  Is this available?  If so, how do we sign up online?', '2009-06-19 15:49:09', '2009-06-19 15:49:09'),
(35, 'Fernando', 'Moreno', 'carr. Mex- Toluc', 'Mexico City', 'Mexico DF.', '01210', '5552925285', 'cpayro@prodigy.net.mx', 'I am 17, I know nothing about golf, but I will like to learn. I already vistied your site, but did not find anything for beginners for my age group. If you could please send me information on which kind of clinic I colud Join I would really be agrateful.  \r\nI will be in Whistler from July 15th on to August 13th.\r\nThank you very much. ', '2009-06-20 16:01:40', '2009-06-20 16:01:40'),
(36, 'Sarah', 'Seex', '', '', '', '', '', 'dsseex@mac.com', 'I would like to book the Nike Junior Golf School camp No 5 on 10-13 August\r\nfor the following\r\n\r\nOliver Seex  (age 10)\r\nDaniel Tilke (age 11)\r\nKatie Tilke (age 9)\r\n\r\nCan you please email me to confirm the booking. \r\n\r\nMany thanks  Sarah', '2009-06-22 16:18:50', '2009-06-22 16:18:50'),
(37, 'Wayne ', 'Holland', '', '', '', '', '', 'wayneholland2002@yahoo.com', 'Have been unable to book tee-times thru players club', '2009-06-23 18:17:07', '2009-06-23 18:17:07'),
(38, 'mike', 'robinson', '3 ainsdale grove, cullingworth', 'bradford', 'west yorkshire', 'BD13 5AU', '00447876448358', 'michael.robinson@arup.com', 'I have recently returned home form a holiday in Whistler/Vancouver. My son has been working in Whistler since September 2008 and we came to see him. He has been working in the snow business as a dog sledge guide and now doing landscaping.\r\nThe reason for my mail is that my son and I used the driving range with a bucket each on the 4th June and I noted from my receipt that we could have been entered in a draw for  a Nike driver. Am I too late or is there a chance of entering, you might tell its a slow day here in England today.I also have to say that I thought Whistler was a fantastic place and whilst this was our first time to Canada it will not be our last.\r\nRegards\r\nMike', '2009-06-24 16:28:38', '2009-06-24 16:28:38'),
(39, 'Sue', 'Doyle', '3876 March Place', 'Port Coquitlam', 'British Columbia', 'V3B 6N9', '604-942-6369', 'srdoyle@shaw.ca', 'I am wondering about booking a tee time July 23, 2009 for 9am, however we (there are 4 of us) purchased golf gift certificates through Costco.  Can you advise how I would go about book a tee time using the coupon?\r\n\r\nThanks in advance\r\nSue Doyle', '2009-06-25 14:59:21', '2009-06-25 14:59:21'),
(40, 'hugues', 'olivier', '10593 st-firmin', 'montreal', 'quebec', 'h2b2g9', '514 812-3572', 'hugues.olivier@videotron.ca', 'i will be competing in the world polcie and fire game this summer and i was  wondering if you sell yardage books so that i could have one sent to me to start getting familiar with the course..\r\n\r\nthanks', '2009-06-27 06:49:27', '2009-06-27 06:49:27'),
(41, 'Chris', 'Agassiz', '4648 Piccadilly North', 'West Vancouver', 'BC', 'V7W 1E2', '604-913-6774', 'cagassiz@shaw.ca', 'Why do you advertise discount rates starting at 2:00pm but when you look online they start at 4:00pm.Also none seem to be avaliable before 7:00 am as advertised.\r\n\r\nRegards \r\n\r\nChris Agassiz', '2009-06-30 00:27:15', '2009-06-30 00:27:15'),
(42, 'Mimi', 'Lai Drivas', '', 'Toronto', 'Ontario', '', '', 'mlai2@hotmail.com', 'Hello - My husband and I are interested in booking a ''9 and Dine'' twilight tee time for Aug5/09.  I didn''t have any success w the online booking site, there were no times avaiable. Is this the case or a glitch in the program?\r\n\r\nSincerely, Mimi Lai Drivas', '2009-07-01 01:06:38', '2009-07-01 01:06:38'),
(43, 'Ric', 'Holman', '1063 Vista Del Monte', 'Camano Island', 'Washington', '98282', '', 'micrere@aol.com', 'I am coming up to play in the Police and Fire World Games in August and I would like to play a practice round on Monday August 3.  Is there anything special I need to do?  Do the participants get a special rate for practice rounds?  The golf and dine special, is that available at anytime during the day (M-T)?\r\n\r\nThanks in advance for the assistence\r\n\r\nR.B. Holman', '2009-07-01 23:53:52', '2009-07-01 23:53:52'),
(44, 'Glenn', 'Ginoza', '98-934 Kahapili Street', 'Aiea', 'Hawaii', '96701', '(808) 488-0051', 'ginoza4@hawaii.rr.com', 'Is club rentals avaliable at the golf course?', '2009-07-06 01:59:25', '2009-07-06 01:59:25'),
(45, 'Mike and EMily', 'Smith', 'Little Waltham', 'Penn', 'Bucks  (UK)', 'HP10 8PQ', '+44 1494 813144', 'mike.emilysmith@btinternet.com', 'Please can you pass a message on to Ryan Pepper - Ryan, can you please call us (we are 8 hours behind time zones) to try to arrange our golf lessons for us and Harriet and Louis - the toll free number is not available from the UK.  Or email us with a number that we can get hold of you on. We arrive in Whistler on Thursday 16th July.  Many thanks, hope all is well,  Emily', '2009-07-08 20:20:01', '2009-07-08 20:20:01'),
(46, 'Desmond', 'Wong', '', '', '', '', '', 'wong.desmond@gmail.com', 'Hi, I have booked 2 nights at Westin and will receive two $50 coupon towards Golf at your golf course. Can I use the coupon to pay my green fee if I have a BC residents rate booking at a Twilight tee time?  \r\nThanks!\r\nDesmond', '2009-07-10 07:47:01', '2009-07-10 07:47:01'),
(47, 'Anthony', 'Baigrie', 'Flat 78 Radnor House 1272 London Rd', 'London', '', 'SW16 4EB', '0203 124 3044', 'anthony.baigrie@lgim.co.uk', '\r\nDear Sirs\r\n\r\nI will be staying at Whistler during August and am hoping to play Whistler Golf Club on the 17th. Please could you confirm whether clubs can be hired and if so what the cost would be. I am looking to play around 10.00 am.\r\n\r\nMany Thanks\r\n\r\nAnthony\r\n', '2009-07-16 08:23:12', '2009-07-16 08:23:12'),
(48, 'William', 'De Vries', '2559 Shelley Road', 'North Vancouver', 'BC', 'V7H 1K1', '604 929-5594', 'devries@sfu.ca', 'Alan, if you can have your picture taken with Sir Charles, can we have one with you? Hope to see you the 21st at our tee time of 10:30. Glad to see you''re living the good life.\r\n         Bill De Vries', '2009-07-17 22:46:39', '2009-07-17 22:46:39'),
(49, 'Jon', 'Resnick', '', 'Hong Kong', '', '', '', 'jon@joninhk.com', 'Dear Whistler Golf,\r\n\r\nMy wife and two college-age kids will be in Whistler during the week of August 16th. We are interested in arranging an Introduction to Golf clinic/lesson. \r\n\r\nCan you please tell me if this is possible, when during that week you could arrange it, what would be included in the package and what are the costs?\r\n\r\nRegards,\r\nJon Resnick', '2009-07-19 09:40:25', '2009-07-19 09:40:25'),
(50, 'Jon', 'Resnick', '', 'Hong Kong', '', '', '', 'jon@joninhk.com', 'Dear Whistler Golf,\r\n\r\nMy wife, I and two college-age kids will be in Whistler during the week of August 16th. We are interested in arranging an Introduction to Golf clinic/lesson. \r\n\r\nCan you please tell me if this is possible, when during that week you could arrange it, what would be included in the package and what are the costs (for 4 people total)?\r\n\r\nRegards,\r\nJon Resnick', '2009-07-19 09:43:03', '2009-07-19 09:43:03'),
(51, 'Jackie', 'Manthorne', '', '', '', '', '', 'jmanthorne@cbcn.ca', 'Hi,\r\n\r\nI am executive director of the Canadian Breast Cancer Network, helping to organize our on-line auction for October 2009.\r\n\r\nCBCN wants to thank you again for your contribution to last year’s auction, it was much appreciated!\r\n\r\nOur annual On-Line Auction will take place during October, Breast Cancer Awareness Month. \r\nWe would appreciate if you could contribute a certificate for two for a day of golf, to help raise funds for our important programs.\r\n\r\nIn return the CBCN recognition program puts your company name on the auction site with your item description and photo; your company will be mentioned in our print publication Network News, and  in our online publication Outreach immediately following the auction, and on our website (which receives 3 ¼ million hits a month!) for one year.\r\n\r\nWe appreciate your participation in helping with the success of our auction!\r\n\r\nThanks,\r\nJackie\r\n', '2009-07-20 16:39:23', '2009-07-20 16:39:23'),
(52, 'Fred', 'Janecke', '508 NW 73RD ST', 'SEATTLE', 'WASHINGTON, USA', '98117', '206 784-5575', 'FWJ2494@YAHOO.COM', 'I''ve booked a tee time for September 10, 2009.  What is your aeration schedule this year, will any work on the greens or rest of the course overlap with the day I''ll be at your course for my round?', '2009-07-22 18:02:39', '2009-07-22 18:02:39'),
(53, 'Dave', 'Conrod', '', 'Langley', '', 'V1M 2K3', '', 'defence@telus.net', 'Hello.  I will be up in Whistler next week.  I want to play Whistler GC on a weekday and want to know if there will be any problem getting fit in as a single, i.e. I will be coming out by myself.  I don''t mind playing with others, especially if one of them is familiar with the course.\r\n \r\nMy other question is whether there are any discounts offered on green fees, e.g. for BC residents etc (I live in Langley).  Thanks for taking the time to look at this message.\r\n \r\nDave Conrod\r\nP.S. I prefer to walk with my pullcart.  Is that okay or are carts mandatory?', '2009-07-24 20:41:25', '2009-07-24 20:41:25'),
(54, 'Tiffany', 'Sanderson', '1477 Dempsey Rd', 'North Vancouver', 'BC', 'V7K 1S8', '604-838-6501', 'tiffanysanderson@shaw.ca', 'Hello,\r\n\r\nI''m currently working at Intrawest Central Reservations in North Vancouver. I see you have BC resident rates, but I was just curious to see if you offered any further discounts to Intrawest employees. I''m planning on coming up September 6th (with a total of 7 of us). We preffer to tee off later in the day (after 3pm).\r\n\r\nIf you could let me know if you offer discounts that would be greatly appreciated. If not, it''s completely understandable (just thought I''d ask).\r\n\r\nCheers,\r\n\r\nTiffany Sanderson', '2009-07-25 01:59:04', '2009-07-25 01:59:04'),
(55, 'Margaret', 'Mickey', '175 Hillcrest Drive', 'Barrington', '', '60010', '847-381-0901', 'mgmdjm75@sbcglobal.net', 'We are interested in knowing what the anticipated 2009 season closing date for Whistler Golf Club is as we are thinking of making a fall trip back to Whistler.  We were just up last week and enjoyed playing the course.\r\n\r\nSincerely,\r\nMargaret Mickey', '2009-07-28 04:11:09', '2009-07-28 04:11:09'),
(56, 'p', 'g', '32', '', 'bc', '', '', '', 'we played your course and all felt that the rate increase this year is not justified by the condition of the course or by the course itself. All of us are BC residents and spend a month to 5 months in Palm Springs', '2009-07-29 00:20:40', '2009-07-29 00:20:40'),
(57, 'Juerg', 'Bollag', 'Kreuzrain 3', 'CH-6313 Edlibach', 'Switzerland', '6313', '+41 41 790 3126', 'brianbollag@bluwin.ch', 'We (my spouse and I) will arrive in Vancouver on September 11th 2009 and would like to spend Friday to Monday (Sept 11 - Sept 14) in Whisler. Could you give us an offer for Golf and Accommodation during this period. We would like to play golf on the 12th and/or the 13th of September.\r\nBest regards\r\nJuerg Bollag', '2009-07-29 13:01:44', '2009-07-29 13:01:44'),
(58, 'Andrea', 'Bundon', '101-2280 Wesbrook Mall', 'Vancouver', 'BC', 'V6T 2K3', '', 'ambundon@interchange.ubc.ca', 'I would like to purchase a gift certificate for the driving range for a couple of friends who live in Whistler.  Is it possible for me to do this over the phone and simply give their names so the credit is there when they go?  I''m not going to be in Whistler for several weeks.  If you could send me a phone number that would be great.\r\n\r\nThanks,\r\nAndrea', '2009-07-29 16:40:34', '2009-07-29 16:40:34'),
