(61, 'Breanne', 'Stovall', '', '', '', '', '303-250-9048', 'stovallb@gmail.com', 'Hi there,\r\n\r\nWe are intersted in taking a sight tour of your wedding facilities.  Is it possible to take a look tomorrow?  I look forward to hearing from you soon!\r\n\r\nBreanne', '2009-07-31 04:35:14', '2009-07-31 04:35:14'),
(62, 'Matt', 'Gore', '', '', '', '', '', 'mgore_9@hotmail.com', 'Hello,\r\n\r\nI am currently working for Whistler Blackcomb in Guest Services. I deal with guest everyday and they ask me about your golf course and If I suggest for them to play or not, and I have never golf at your course so I cant answer them, as I cant afford it. So I was wondering If I could have a familiarization round so I can send guest to play at your course?', '2009-08-02 01:53:19', '2009-08-02 01:53:19'),
