(67, 'Philip & Fay', 'Brandon', '67 Babbage Rd', 'Roseville Chase', 'Sydney, Australia', '2069', '61-2-9882-2455', 'normarie@bigpond.net.au', 'We wish to make a Tee time booking for morning of Friday 18 September, preferably about 10am. \r\n\r\nWe will be staying at Fairmont Chateau Whistler, nights of Thurs. 17 & Friday 18 September. We hold Handicaps of 23 & 29 being members of Cromer Gold Club in Sydney. We are happy to play in any Comp being held on that morning.\r\n\r\nPlease let us know of availability and any deposit required.\r\n\r\nThank you for your attention to this request.\r\n\r\nRegards,\r\n\r\nPhilip & Fay Brandon.', '2009-08-10 22:34:45', '2009-08-10 22:34:45'),
(68, 'raymond ', 'kwok', '1471 riverwood gate', 'port coquitlam', 'b.c.', 'v3b 7p1', '604 945 5538', 'rcwkwok@telus.net', 'I am planning to have a round of golf with my family, that is two adults and two juniors(14&17 respectively}. I wonder if there are any restrictions of play? Please let me know so that I can book accordingly. Thank you!', '2009-08-14 01:12:53', '2009-08-14 01:12:53'),
(69, 'david', 'w', '', '', '', '', '', 'david.wingate@education.tas.gov.au', 'hi, i am wanting to know if the driving range is open during the winter??\r\n\r\nthank you', '2009-08-15 02:01:28', '2009-08-15 02:01:28'),
(70, 'Roger', 'Lienesch', '17079 Brittany Drive SW', 'Normandy Park, Wa US', '', '98166', '206-708-1820', 'single1coil@hotmail.com', 'Pro Shop,\r\n\r\nI sent back a belt, via mail, I purchased from your store that fell apart the same day I bought it. Can you find out the status. Appreciate it.\r\nthanks,\r\nRoger Lienesch', '2009-08-15 15:43:17', '2009-08-15 15:43:17'),
(71, 'Richard', 'Colla', '', 'Leiden, The Netherlands', '', '', '', 'richard.colla@casema.nl', 'Hi There,\r\n\r\nDo you require a golf certificate or can anyone (with golf experience) play at your club.\r\n\r\nKind regards,\r\nRichard Colla', '2009-08-16 08:52:50', '2009-08-16 08:52:50'),
(72, 'lyndsay', 'walter', '835 west King Edward Ave ', 'Vancouver ', 'BC ', 'V5Z 2C9 ', '778-866-1046', 'lyndsayw@rogers.com ', 'Luc Binette, Alan Kristmanson, Dave Gottselig\r\n\r\nI recently played your course and was very dissapointed.  I had guests from Toronto and was hoping to provide them with a wonderful expereience.  We played on August 13th.  While we were on the couse maintenance crews were aerating the approach to the greens.  Not just one but every green.  Due to the rain this meant that there were plugs of mud on every hole.  Not only did this affect every shot onto the green but caked our balls, clubs and shoes with mud.  \r\nAfter our game we decided to eat in the dining room.  3 of us ordered the 6 oz steaks.  When they arrived on of my guests steaks was notably smaller - I would say without exageration about 3 oz.  When he commented the server simply laughed and said " Take some off her plate" \r\nMy husband then ordered a grand marnier with his coffee - To our suprise it came mixed in with the coffee and not in a seperate glass.  We did send back the coffee and provide more explicit instructions. \r\n\r\nFor the calibre of course (and price) I found our entire experience unacceptable.  I certainly hope when the Olympics are on and we have Guests from around the world visiting Whistler your team has taken the time to coach the appropriate customer service skills that will leave a much better impression on your guests. \r\n\r\nLyndsay Walter', '2009-08-16 17:57:02', '2009-08-16 17:57:02'),
(73, 'Mimi', 'T', '4484 Townley Street', 'Vancouver', '', 'V6L 2G6', '778-882-1362', 'koalaclaus@hotmail.com', 'Hello,\r\n\r\nI am wanting to make a reservation with the Stay and Play Package. However, I will need some more details. Which hotels are associated with this package? Are there any availabilities between Sept 4-6? If so, which hotels are available and what are their rates?\r\n\r\nThank you!', '2009-08-18 07:22:39', '2009-08-18 07:22:39'),
(74, 'Daan', 'van den Berg', 'Van Riebeecklaan 6', 'Haarlem', '', '2024 AH', '', 'daanvandenberg@me.com', 'We last week booked a 19 holes at the whistler golf. We also rented the Nike clubs which felt pretty good.\r\n\r\nIn the meantime we are already back in our main country, The Netherlands, and are interested in buying a new set of golfclubs.\r\n\r\nIs it possible to give us the name of the specific Nike Clubs which we used last week??\r\n\r\nThank you in advance for your help.\r\n\r\nKind regards,\r\n\r\nDaan van den Berg\r\nvan Riebeecklaan 6\r\n2024 AH Haarlem\r\nThe Netherlands\r\n\r\ndaanvandenberg@me.com\r\n', '2009-08-25 16:46:57', '2009-08-25 16:46:57'),
(75, 'Gloria', 'Veale', '', '', 'Manitoba', '', '', 'gloriaveale@shaw.ca', 'Good day\r\n\r\nHow late in the season do you anticipate being open till?  \r\n\r\nKind regards\r\n\r\nG  gloriaveale@shaw.ca', '2009-09-07 15:33:25', '2009-09-07 15:33:25'),
(76, 'Loretta', 'Hill', '1216 Gilley Cres', 'Parksville', 'B.C', '', '', '', 'Alan - Changing our Tee time from 0750 to 0800 on Sept 13 is no problem.', '2009-09-11 14:39:12', '2009-09-11 14:39:12'),
(77, 'Stan', 'Cooper', '', '', 'ON', '', ' 1 (905) 415-1338', 'info@axglo.com', 'Axglo Inc. - 4 wheel Push Golf Cart \r\n\r\nDear Sir or Madam\r\n\r\n\r\nAxglo Inc., a manufacturer of golf carts, is offering the latest in 4 wheel push golf carts. With production in China and offices in Toronto, Ontario Canada. We are pleased to offer the latest in golf cart technology.\r\n\r\nFeatures:\r\n\r\n- 4 wheel platform. \r\n- Super light weight - approximately 13lbs, folds down to the smallest 24''X15''X11'' \r\n- Custom made storage bag included - keeps car/trunk clean.\r\n- Carries almost all golf bags.\r\n- Front wheel breaking system.\r\n- Beverage and umbrella holder\r\n- Console for cell phone, golf balls etc. \r\n- Adjustable handle. \r\n- 3 year warranty\r\n\r\nPlease see our website for more information at www.axglo.com\r\n \r\nSchedule of PGA Merchandise Show Exhibit\r\n\r\nOntario Canada	October 28- 29, 2009	Booth# 300\r\n \r\n\r\n\r\n\r\nFor further information please contact Stan Cooper at 1 (905) 415-1338.\r\n\r\n\r\nBest Regards,\r\n\r\n\r\nStan Cooper\r\n\r\n\r\nDirector of Sales\r\nAXGLO Inc. \r\nHead Office: 1 (905) 415-1338\r\nEmail: info@axglo.com\r\nWebsite: www.axglo.com\r\n', '2009-09-16 18:55:59', '2009-09-16 18:55:59'),
(78, 'Sam', 'Linsell', '', '', '', '', '604 907 2734', 'samlinsell@gmail.com', 'Hi,\r\n\r\nI would like to know if you are selling off your ex-rental clubs this year. If so, what are the prices and would you sell off clubs individually or do they have to be bought as a set?\r\n\r\nReally, I am looking for a 3 hybrid and a driver.\r\n\r\nMany Thanks,\r\n\r\nSam', '2009-09-17 21:32:52', '2009-09-17 21:32:52'),
