(80, 'madalina', 'rusu', '', '', '', '', '', 'madalina_rusu@hotel-systems.com', '\r\nDear webmaster,\r\n \r\nWe would be delighted to exchange links with your site that we found using Google search.\r\n \r\nWe would add a link to your site on our site if you would agree to this link exchange invitation.\r\n \r\nHere you have the information for our site as it should appear:\r\n \r\nLink Title: Welcome to Whistler Blackcomb Lodging!\r\n \r\nURL:  http://www.whistlerblackcomblodging.com/\r\n \r\nDescription: Our goal is to combine the convenience of close hotels with the comfort and hospitality of Whistler. Book securely online by list, map, or view our featured hotels!\r\n \r\nReciprocal link URL: http://www.whistlerblackcomblodging.com/resources.html \r\n \r\nPlease be kind and reply me an answer using:\r\n \r\nmadalina_rusu@hotel-systems.com\r\nrusumdln@yahoo.com\r\n \r\nBest  regards,\r\nMadalina Rusu\r\n', '2009-10-04 17:28:17', '2009-10-04 17:28:17'),
(81, 'Yvette', 'Rios', 'P.O. Box 4173', 'Anthony', 'New Mexico', '88021', '', 'riosyvette@yahoo.com', 'To Whom it may concern,\r\n\r\nMy name is Yvette Rios, I am currently a senior at New Mexico State University Getting my Bachlers degree in Hotel Restaurant Tourism Management. We are doing a project on your facilities and I was wondering if you could answer a couple of questions for us. \r\n1.What is the avarage check on each person when it comes to Food & Beverage?\r\n\r\nThank as of now this is the only question that we do have. But if you could help us out we would greatly appriciate it.\r\n\r\nOnce more than you for your time.\r\n\r\nYvette Rios', '2009-10-07 18:30:18', '2009-10-07 18:30:18'),
(82, 'Yvette', 'Rios', 'P.O. Box 4173', 'Anthony', 'New Mexico', '88021', '', 'riosyvette@yahoo.com', 'To Whom it may concern,\r\n\r\nMy name is Yvette Rios, I am currently a senior at New Mexico State University Getting my Bachlers degree in Hotel Restaurant Tourism Management. We are doing a project on your facilities and I was wondering if you could answer a couple of questions for us. \r\n1.What is the avarage check on each person when it comes to Food & Beverage?\r\n\r\nThank as of now this is the only question that we do have. But if you could help us out we would greatly appriciate it.\r\n\r\nOnce more than you for your time.\r\n\r\nYvette Rios', '2009-10-07 18:42:14', '2009-10-07 18:42:14'),
(83, 'Ken', 'Hazzard', '10-7315 Meadow Ave', 'Burnaby', 'BC', 'V5J 4Z2', '604-431-9504', '', 'On Sept 26,2009 I played on your course with a group from PROLINE CONSTRUCTION MATERIALS ( Andy Mrak) Last weekend I dic=scovered an extra club in my bag which is not from any of the places here so it may be from your location. I have a "Cobra" #5 iron with Graphite shaft, RH. If anyone has reported loosing such a club, have them get in touch with me. Thanks, Ken Hazzard ', '2009-10-07 23:44:25', '2009-10-07 23:44:25'),
