(85, 'AC', 'Jetter', '', 'Elkhorn', 'NE', '68022', '', 'ace@jetter.com', 'Hello,\r\n\r\nI stayed in Whistler last year, and played a couple rounds of golf at Whistler CC.\r\n \r\nI''ve recently started collecting pin flags for the courses I''ve played, and I wondered if you happened to have any for sale that I could purchase?  I live in the USA, so I would also need it shipped here.\r\n \r\nThank you!\r\n \r\nac.\r\n', '2009-10-16 16:53:49', '2009-10-16 16:53:49'),
(86, 'Michael', 'Hughes', '#16 2201 Eva Lake Road', 'Whistler', 'BC', 'V0N 1B2', '604-966-4347', 'michaelhughes555@hotmail.com', 'Dear Sir/Madam,\r\n\r\n \r\n\r\nMy name is Michael Hughes. I am a British National with a One Year Canadian Working Visa obtained through BUNAC. I am now living in Whistler, with accomodation untill April 30th 2010. I can extend this date if needed.\r\n\r\nIn my last employment role I was the Assistant Manger of a Hotel in Cwmbran, Wales. I am now looking for employment during the Whistler ski season. \r\n\r\n \r\n\r\nPlease find below my Resume.\r\n \r\nMany Thanks\r\n \r\nMichael Hughes\r\n\r\n\r\n\r\nResume: Michael Stephen Hughes \r\n\r\nmichaelhughes555@hotmail.com Tel: 604 966-4347\r\n\r\n#16 2201 Eva Lake Road, Nordic Estates, Whistler, BC VON 1B2\r\n\r\n \r\n\r\n Summary of Qualifications\r\n\r\nA Graduate of a top 20 British University, a veteran from a previous one year working holiday through Australasia and a successful Assistant Manager of a hotel\r\n\r\n \r\n\r\nEducation\r\n\r\n2003-2006 Southampton University, England, 2.1 honours B.A. Geography degree\r\n\r\n2001-2003 Croesyceiliog Sixth Form, Wales, Graduated High School with A & B grades\r\n\r\n \r\n\r\nEmployment History\r\n\r\nCommodore Hotel February 2009 to September 2009\r\n\r\n·        Assistant Manger\r\n\r\n·        Primary duties were to oversee the running of the front of house services\r\n\r\n·        Extended to being responsible for the hotel in the managers and owners absence\r\n\r\n·        Had leading role in dealing with David Urquhart Coach Tours\r\n\r\nBest Western Parkway Hotel 4* April 2008 to January 2009 \r\n\r\n·        General Assistant\r\n\r\n·        Aided the Duties Managers and Departmental Heads\r\n\r\n·        Had leading role in organizing and executing the large Christmas Specialty Nights\r\n\r\nHeritage Queenstown, New Zealand July 2007 to October 2007\r\n\r\n·        Operated the Restaurant or the Bar\r\n\r\n·        Received New Zealand Occupational Health and Safety training\r\n\r\nBest Western Parkway Hotel 4* December 2001 to April 2007\r\n\r\n·        Progressed from silver service banqueting into the restaurant, bar and leisure departments\r\n\r\n·        After university commitments became full-time and promoted to Restaurant Supervisor\r\n\r\n \r\n\r\nKey Skills\r\n\r\nResponsibility: Operating a hotel for extended periods during the manger and owners absence.\r\n\r\nTeam working: Vast experience of team working as well as team leading\r\n\r\nEffective communication: Highly developed from close customer contact\r\n\r\nPublic Speaking: Experience from welcome speeches and entertainment for coach tours \r\n\r\nInitiative: Developed to deal with the unpredictable nature of the hospitality industry\r\n\r\nProblem solving: Developed from dealing with customers while having to be calm and effective\r\n\r\nTechnical skills: Fully competent with Microsoft Office and Micros till programming\r\n\r\nMeeting Targets: Experience of meeting company targets, such as sales and wage percentage, while also meeting and exceeding the customers’ expectations\r\n\r\nSales: Vast experience of face-to-face sales and telephone enquires\r\n\r\n \r\n\r\nInterests\r\n\r\nInclude travelling, sports including football, rugby and skiing and a desire to learn and progress\r\n\r\n \r\n\r\nReferences upon request\r\n\r\n', '2009-10-20 23:43:54', '2009-10-20 23:43:54'),
(87, 'Pamela', 'Findlay', '28-1615 Shaughnessy St.', 'Port Coquitlam', 'B.C.', 'V3C 6K9', '(778)888-6026', 'pjf@taylorbritt.com', 'I would like to find out if you have any golf packages available for 2010 so I can purchase a round or two for my Husband for Christmas. We belong to Intrawest and I would like to buy him some golf he can use anytime through the spring/fall. Do you have anything like that?\r\n\r\nThank you\r\n\r\nPam Findlay', '2009-10-23 01:20:57', '2009-10-23 01:20:57'),
(88, 'Anatia', 'Combs', '1414 C Street', 'Lynden', 'WA', '98264', '360-815-3180', '', 'I am going to be getting married next June 2010 in Whistler and am requesting any pertinent information you may have regarding your facilities.  We would like the wedding to be either June 25, 2010 or June 28, 2010.  Please let me know about availability of those dates or any other dates between June 25-June 30.\r\nThank you!\r\n\r\n', '2009-11-16 22:57:30', '2009-11-16 22:57:30'),
(89, 'Kyle', 'Corcoran', '', '', '', '', '', 'kylecorcoran19@hotmail.com', 'I was wondering who I could contact in regards to 2010 summer employment\r\n\r\nthanks!', '2009-11-20 04:08:30', '2009-11-20 04:08:30'),
(90, 'Robert', 'Moestl', 'Zur Eichenbitze 36', 'Hennef', 'Germany', 'D-53773', '01149 - 2242 - 901157', 'r.moestl@t-online.de', 'Good morning, over there in Whistler!\r\n\r\nMy name is Robert, I´m a German resident. My wife Annelie (has a dual citizenship, German/American) an I are passionate golf players AND we love Canada!\r\n\r\nSince years we are dreaming about staying longer than just a short vacation and working in your beautiful country: Whistler Golf Club seems to be the perfect place to do so!\r\n\r\nWell, next summer (June/July 2010) we`ll be travelling around the west coast of B.C., including a few days in Whistler. That would be a perfect chance to meet you and talk about opportunities!\r\n\r\nTo be honest: Next year, I`ll be 50 years young, my wife Annelie 47. Our two sons are adults right now, that helps us being flexible and "free" again!\r\n\r\nOur talents are various: Annelie used to work in a tour operating company (she`s a native English speaker) and is now helping me in my small business. That business is Directmarkting Consulting, especially for mailorder companies. My English is good enough for communication, having fun with Canadian Friends an writing you these words.\r\n\r\nWe would be glad to get into contact with you. If you don`t think that we are too old to help you to develop your business, please write back!\r\n\r\nRobert and Annelie\r\n\r\n', '2009-11-20 10:13:42', '2009-11-20 10:13:42'),
(91, 'Jarrod', 'Arps', '', '', '', '', '', 'four_walls@optusnet.com.au', 'Hi,\r\n\r\nJust wondering if there is anyway that I can contact the Superintendent of the course?\r\n\r\nKind Regards,\r\nJarrod Arps', '2009-11-23 03:39:17', '2009-11-23 03:39:17'),
(92, 'Madryn', 'Abnett', 'Plummers Farmhouse', 'Fordham', 'UK', 'CO6 3NP', '', 'madrynabnett@tiscali.co.uk', 'We are intending to travel in Canada in May/June 2010 and would like to play in Whistler. Our itinerary to date is to be there towards the end of May. Our agent has suggested we stay in the Westin Resort but I notice you have a play and stay package. As this will be about our 40th wedding anniversary I can think of nothing nicer than playing golf (sunshine only). Could you tell me a bit more about the packages and what the accommodation is?\r\n\r\nMany thanks  Madryn', '2009-11-23 12:47:39', '2009-11-23 12:47:39'),
(93, 'Jeff', 'Berger', '603 - 1330 Pendrell St.', 'Vancouver', 'BC', 'V6E 1L9', '604-315-0480', 'jberger@innovativefitness.com', '\r\n\r\nGood evening,\r\n\r\nI know we''re looking quite a ways into the future, but I was wondering what your projected opening day is for 2010?  I''m organizing a group golf trip from April 28 - May 2 and plans need to be finalized ASAP.  Thank you for your time.\r\n', '2009-11-30 01:50:01', '2009-11-30 01:50:01'),
(94, 'Matthew', 'Parker-Bevin', '1904-1450 W. Georgia St', 'Vancouver', 'British Columbia', 'V6G 2T8', '778-938-2395', 'mparkerbevin@gmail.com', 'Hi there.\r\n\r\nI am planning on moving back to whistler for next summer. A couple of years ago I saw that the Whistler Golf Club had a job fair before the summer. Is this in the works for next summer and if so, when is this likely to happen?\r\n\r\nThanks', '2009-12-02 05:03:50', '2009-12-02 05:03:50'),
(95, 'Jordan', 'Gosselin', '575 Dalhousie Dr', 'Thunder Bay', 'Ontario', 'P7C5P2', '807-621-3427', 'jordangosselin_@hotmail.com', 'I am just wondering about summer employment. I am currently taking "Professional Golf Management" at Humber College, in Toronto, Ontario. I am looking for a summer placement job. Just wondering who I could contact about a possible spring/summer/fall placement job.', '2009-12-02 23:16:48', '2009-12-02 23:16:48'),
(96, 'Patrick', 'McEntee', '', 'DUblin ', '', 'Ireland', '', 'patrick@pgm.ie', '4 of us are attending a conference in June 2010 and arrive via London UK in Vancouver on evening of 10th june 2010, would it be practical to play 3 games on  friday, saturday and sunday in the Whistler area ? we  return to Vancouver on sunday afternoon/ evening.\r\ni would appreciate your comments , advice on transfers and costs involved \r\n\r\nmany thanks\r\n\r\npatrick', '2009-12-04 08:12:27', '2009-12-04 08:12:27'),
(97, 'Barry', 'Dewar', '#3 2361 Tranquille Rd', 'Kamloops', 'BC', 'V2B3N6', '250-574-7811', 'dewar@vip.net', 'We are wondering if you would consider giving us 8 rounds of golf at your golf course.  \r\n\r\nThis is not so much a donation as an advertising opportunity.  We plan to run a raffle with the golf passes as the prize.  \r\n\r\nWe have already gotten confirmation from Tobiano that they are in.  \r\n\r\nThe idea is that the prize be four rounds with carts and accommodation.  First prize would be four rounds at Tobiano and three other courses we are thinking Fairview in Oliver, Osoyoos and  yourselves.  Total of 12 rounds.  Second prize might be four rounds at Tobiano and one of the other courses, third prize to 6 prize would be 4 rounds at one course each.  \r\n\r\nThis raffle is to be conducted to support the Western Canadian Hockey Championship at our level, and will bring people to the area who do not normally golf in the Kamloops/ BC region.   I think that this will open your course up to other golfers who do not normally get the opportunity to golf at your course.  I think it is an inexpensive and effective form of advertising that will get your course name out to people throughout western Canada. \r\n\r\nI do hope you will consider supporting our tournament.  \r\n\r\nBarry Dewar\r\nGeneral Manager\r\nKamloops Storm \r\n250-376-0990 office\r\n250-574-7811 cel\r\n\r\n', '2009-12-07 21:57:09', '2009-12-07 21:57:09');
