(98, 'Diana', 'Millar', '8133 112b street ', 'Delta', 'British Columbia', 'v4c 5a9', '1 604 767 4225', 'diana.millar@hotmail.com', 'Good afternoon! \r\n\r\n \r\n\r\n I am very interested in getting my foot in the door with a well established company.  I understand I have to start from the bottom and work myself up, as so, I am looking to you, and asking if you may now, or in the future may have any positions opening up, idealy a hotel front desk agent.    Although I am not experienced in this industry, I do have the passion and commitment to learn, and being a hard and fast learner I am positive I would be a perfect fit for this position.  I am looking for a career not just a job, and with my years of customer service experience and my ability to problem solve and my leadership skills, am I am hoping that I could start a career with such a reputable company as yourself.  I am currently based in Vancouver, but as of the first of March I am relocating to Whistler, and If you found me as a suitable candidate for this position, I do have a place to stay in Whistler before the first of March.  \r\n\r\n \r\n\r\nThank you for your time in reviewing my application and I hope to hear from you soon. \r\n\r\nAll the best, \r\n\r\n\r\n\r\nDiana Millar\r\n\r\n\r\n \r\n\r\n \r\n\r\nDiana Millar\r\n\r\n8133 112B Street\r\n\r\nDelta B.C.\r\n\r\nV4C 5A9\r\n\r\n604 767 4225\r\n\r\n604 596 0351\r\n\r\n?\r\n\r\n \r\nOBJECTIVE \r\nTo acquire the means to finance my post secondary education, and provide for professional growth.\r\nPERSONAL AND GENERAL\r\nTeam player in small or large group atmosphere and comfortable working independently.\r\nInterests include: hospitality industry, movie industry and sports. Social activities include, friends, music, and travel.\r\nEDUCATION\r\n\r\n2005 Vancouver Film School\r\n\r\n        2004 North Surrey \r\n\r\n2004 Tourism Course, Super Host\r\n2004 Serving It Right \r\n\r\nWORK HISTORY\r\n2006 to present Great Canadian Casinos Inc. \r\nEmployed as a cashier. Duties include: handling large sums of cash and chips, cashing in, and cashing out procedures, \r\ncashing out tickets, issuing and balancing floats, currency exchange, administer chip fills and credits, processing hopper fills and jack pots. \r\n2005- 2006 Fitness World\r\nEmployed as customer service representative. Duties included: gretting guests, opening and closing procedures, processing memberships, cash.\r\n2004-2005 Eccotique Day Spa\r\nEmployed as a Spa Coordinator. Duties included: Inventory managment, cash handling, opening and closing procedures, basic computer operations, filling orders, product demontrations.\r\n2004-2005 Real Canadian Wholesale Club\r\nEmployed as a cashier. Duties included: handling cash, restocking shelves, returns, currency exchange and customer service.\r\n1999-2004 Sears Canada Inc.\r\nEmployed as a seasonal support staff during Christmas season and other holiday seasons. Duties included: merchandise checks,\r\nstocking shelves, shoes, clothing, cosmetic counter, gift wrapping, and customer service.\r\nREFERENCES\r\nAvailable upon request.\r\n', '2010-01-13 23:51:23', '2010-01-13 23:51:23'),
(99, 'Bob', 'Erickson', '20810 33rd Avenue West', 'Lynnwood', 'Washington, USA', '98036', '(206) 963 5963', 'boberickson@clearchannel.com', 'We will be coming to a retreat this April 30th through May 2nd, and very much hoping the golf season will have started.\r\n\r\nDo you have a set start date, or is it totally weather dependent? I saw on the Nicklaus course website that they plan to open May 7th.  \r\n\r\nDo all the courses in the Whistler area typically open the same time, or do you or any others some times open sooner.\r\n\r\nThank you', '2010-01-24 23:45:27', '2010-01-24 23:45:27'),
(100, 'Kate', 'Gentil', 'PO Box 2493', 'Garibalid Highlands', 'BC', 'VON 1T0', '', 'vkgentil@telus.net', 'I am writing on behalf of our Relay for Life team called the Brackendale Babes who are taking part in this year’s Relay for Life sponsored all night walk, run by The Canadian Cancer Society this coming June.  We were the top fundraising team in Squamish last year and we are endeavoring to again raise as much money as possible for this important charity.\r\n\r\nMy reason for contacting you is that we are going to have a raffle on the 17th March 2010 and wondered if your organization would kindly donate a voucher as a prize.\r\n\r\nShould you be able to help I would be grateful if you could send the voucher to: -\r\n\r\nKate Gentil\r\nPO Box 2493\r\nGaribaldi Highlands \r\nV0N 1T0\r\n\r\nThank you for your time and consideration.\r\n\r\nRegards\r\n\r\nKate Gentil\r\n\r\n', '2010-01-26 18:56:12', '2010-01-26 18:56:12'),
(101, 'pete', 'morrish', '3181 west second ave', 'vancouver', 'b.c.', 'v6k 1k7', '6046412701', 'pmorrish@canadaici.com', 'Just want to make sure i am notified in time to sign my son Henri up again for the nike junior golf school...its his favorite thing in the summer and i want to make sure he gets in once again...thanks, pete  ps this will be year 3', '2010-01-27 00:49:38', '2010-01-27 00:49:38'),
(102, 'Everett', 'Meurer', 'Suite 101, 10th floor,', 'New York', '', '10011', '212-556-5595', 'everettmeurer@gmail.com', 'Dear Sir/Madam,\r\n\r\nI have a blog, EnjoyGolf.Com, that features information for golfers worldwide. We would like to FEATURE your golf course on our site (we are only featuring 100).\r\n\r\nI am writing to ask permission to use several photos and copy from your site to create an overview of your course in our listings. Would this be acceptable?\r\n\r\nPlease email back with permission and we will proceed to add your site to our top golf course listings.\r\n\r\nThanks for your kind permission. Please let us know quickly because our site is being updated just for the next few days with this information.\r\n\r\nBest regards\r\n\r\nEverett Meurer\r\n\r\nWebmaster\r\nEnjoyGolf.Com', '2010-02-02 05:12:03', '2010-02-02 05:12:03'),
(103, 'Dave', 'Palmer', '', '', '', '', '', 'dpalmer@linkscapegolf.com', 'Hi there\r\ncould you let me know when you are programmed to open in May as we are staying in Whistler May 4th-6th and would like to play if possible\r\n\r\nKind regards\r\n\r\nDave & Karen Palmer', '2010-02-05 11:59:05', '2010-02-05 11:59:05'),
