(105, 'Tucker', 'Boyce', '515 Newport Trace', 'Alpharetta', 'NA', '30005', 'NA', 'tuckerboyce@gmail.com', 'Hello,\r\n\r\nI am a student from the United States whom is very interested in the upcoming Olympic Games in Vancouver. Consequently, my hobby is Olympic pin collecting. Since your restaurant has won numerous awards and is one of the finest in Vancouver, I assume that people from the Vancouver Olympic Association have been to your restaurant, or you have customers from Olympic sponsors. So, I was wondering if your restaurant staff has received Olympic pins from your guests or can acquire them. Then, I was wondering if you could please send me some of those pins. My address is 515 Newport Trace, Alpharetta, GA, USA, 30005.\r\n\r\n \r\n\r\nThank you,\r\n\r\nTucker Boyce\r\n\r\n515 Newport Trace\r\n\r\nAlpharetta, GA, USA\r\n\r\n30005', '2010-02-15 01:40:43', '2010-02-15 01:40:43'),
(106, 'chris', 'armstrong', '9267 emerald dr', 'whistler', 'bc', 'V0N 1B9', '6049325965', 'ckarmstrong@telus.net', 'Can you confirm that your perfect 10 pass for a couple is $895 this year for 10 games.Last year we got "12" games with the perfect 10 pass and paid $895??\r\n\r\nThanks\r\nChris', '2010-02-22 00:47:28', '2010-02-22 00:47:28'),
