(115, 'Ryan ', 'Davies', '', '', '', '', '', 'pakk6@hotmail.com', 'I am an ex Golf Professional from Jasper, AB. I will be in Whistler for the summer and am looking for a place to play golf, work on my game, practice etc. If you could give me a call @ 780-852-8704. I would appreciate a phone call in the near future to find out more about your membership rates!\r\n\r\nSincerely,\r\n\r\nRyan Davies', '2010-03-09 01:15:03', '2010-03-09 01:15:03'),
