(118, 'Longview ', 'Meat Sancks ', 'PO BOX 73 ', 'Longview ', 'Alberta ', 'T0L 1H0 ', '1-866-355-3759 ', 'lbj@longviewjerky.com ', 'Spring is finally hitting BC and we at Longview Jerky are gearing up for another hungry season.\r\n\r\nWe want to make sure Longview meat snacks are available to you and your patrons on opening day.\r\n \r\nJerky, Roni Stix and Bavarians sell so well in the Golf Industry that we want to make sure you have ample inventory on hand for opening day, and throughout the season to meet your customer’s cravings. Longview Meat and Merchandise Ltd has the meat snack offering guaranteed to please you and your golfers.  \r\n  	\r\nJerky, a HIGH PROTIEN snack that gives that boost of energy every athlete craves to enhance performance. Easy to take along or buy right off the beer wagon, Jerky is a golfer’s best ENERGY ration on the course. Your beverage carts should all be stocking Longview Jerky for the athlete on your turf.       \r\nRoni Stix – great small snack we like to call a FOURSOME. It’s ideal for a small snack for a 4-member round. Even though there are 4 Pepperoni Stix per package, 4 stix may not be enough. Most golfers will buy more than one package to get them around even a 9 hole course, or they’ll buy our larger packages. .\r\nBavarians will likely improve your beer sales. We have testament that these “Canadian made” European sausages contain just the right flavour that blends so well with Canadian Beer, it creates cravings. I have personal experience with this, and the added advantage is it’s shelf stable, no refrigeration needed (other than for the beer) and comes in MILD, MEDIUM and HOT to satisfy all golfer’s tastes.  \r\n\r\nLongview products are 100% guaranteed. Whatever inventory is left at the end of the season, we’ll take back for full credit. Load up a bit now, and sell throughout the season. Re-ordering inventory during the season is no problem. We can ship product directly from our federally inspected production plant here in Longview to arrive in 5-10 days. Be sure to have Longview Meat Snacks available all season long. We have full floor Display Racks for the Club House, Countertop Plexiglass Displays for the snack sections, or other merchandising ideas to suit your Clubhouse and Beer Carts requirements.  \r\n\r\nGive me a call or contact me by return E-mail to get you set up for the season. It’s not all about profits, it’s about a great golf experience and our meat snacks have a proven record of customer satisfaction. Selling Longview Meat Snacks is profitable, with wholesales prices and delivery right to your door. See our product listings and pricing at  www.longviewjerky.com and give me a call to discuss your opening date timing and meat snack requirements. \r\n\r\nBest Regards;\r\nLongview Beef Jerky \r\nJim Norsworthy \r\nToll Free 1-866-355-3759\r\n403-558-3706 \r\n', '2010-03-11 19:36:51', '2010-03-11 19:36:51'),
(119, 'Krista', 'Rhodes', '16055 N. Dial Blvd. Ste 5', 'Scottsdale', 'US', '85260', '480-556-0162', 'krista@golfgps.com', 'Hi,\r\n\r\n We''ve been trying to round up the information from your course, more specifically the slope/rating and handicaps. Your scorecard was helpful, but we are still in need of the handicaps for each hole as they would appear on a scorecard. This will greatly assist us in better serving our mutual customers.\r\n\r\nThank you for your help,\r\n\r\nKrista Rhodes', '2010-03-17 16:09:05', '2010-03-17 16:09:05'),
(120, 'Anja', 'Sailer', '267 West Esplanade Ave', 'Vancouver', 'BC', '', '604 985 7932', 'canada@ctp-lanz.ca', 'Dear Sir or Madame,\r\n \r\nI hope you can help me with an urgent request: I am right now trying to organize a barbecue dinner for one of our tour groups.  The group consists of 32 people and they will stay in Whistler for 1 night on May 27.  I thought having this dinner on your restaurant patio would be a great idea.  Do you offer dinners for larger groups?  And how much would it be per person incl. tax?\r\n \r\nIn case you are not accepting group reservation perhaps you could recommend another location.\r\n \r\nThank you very much in advance!\r\n \r\nHave a great evening and best regards,\r\n \r\nAnja\r\n\r\nAnja Sailer\r\nTour Coordinator\r\n \r\n**************************************************\r\nCanadian Travel Partners Ltd.\r\n202-267 West Esplanade Avenue\r\nNorth Vancouver, BC  V7M 1A5\r\nCanada\r\nPh: +1 (604) 985-7932\r\nFax: +1 (604) 985-7936\r\nEmail: canada@ctp-lanz.ca\r\nWeb: www.canadian-travel-partners.com\r\n', '2010-03-19 00:21:31', '2010-03-19 00:21:31'),
(121, 'Anna', 'Walsh', '17 Deerpark Ave, Castleknock', 'Dublin', 'Ireland', '15', '+353851018613', 'annalucy@gmail.com', 'I was looking into getting a voucher for my brother who will be working in Vancouver for the summer for a sunset round of golf with club hire. He will be based in Vancouver from June until the end of August and is a keen golfer. Would it be possible to purchase a voucher online that he could use over the summer months. He is an Irish university student.\r\n\r\nThank you,\r\nAnna Walsh', '2010-03-21 03:07:43', '2010-03-21 03:07:43'),
(122, 'Gale', 'Sheiles', '1/1a Lillis Street', 'SYDNEY', 'NSW - AUSTRALIA', '2062', '', 'gsheiles@claytonutz.com', 'Could you please let me know the cost of 4 people with carts at your course at 3:00pm on August 10, 2010\r\n\r\nThanks', '2010-03-25 02:30:02', '2010-03-25 02:30:02'),
(123, 'Adam ', 'Smith', '6 paddock Close ', 'Ravensthorpe', 'Northants, England', 'NN6 8EQ', '+44 (0) 7825 877 689', 'i7825759@bournemouth.ac.uk', 'Dear Whistler Golf Club, \r\n\r\nI am a second year student studying Sports Management (golf) at Bournemouth University, England. For our 3rd year of study it is required to find and complete a 40 week placement. I have always been interested in working over seas especially in Canada with its excellent golfing tradition.\r\nHaving looked through your website, which is very impressive it has given me aspirations to work with you in Whistler. \r\nIf you could please provide me with any information regarding placement opportunities you offer or a contact email address this would be more than appreciated.\r\n\r\nYours Sincerely, \r\n\r\nAdam Smith\r\n\r\n', '2010-03-25 17:21:19', '2010-03-25 17:21:19'),
(124, 'Kermit', 'Crissey', '34 Guernsey St.', 'Buffalo', 'NY', '14207', '716-874-3189', 'khcrissey2008@yahoo.com', 'I was hoping you might be able to send me a scorecard and or yardage guide from your golf course,I collect golf cards and yardage guides from golf courses around the world and hope to add yours to my collection. I can''t play golf myself due to a childhood illness, but I am an avid fan of the game.Thank you very much.\r\n\r\nKermit Crissey\r\n34 Guernsey St.\r\nBuffalo, NY 14207\r\nUSA', '2010-03-27 16:35:51', '2010-03-27 16:35:51'),
(125, 'bill', 'quackenbush', '# 1803  615 hamilton street', 'new westminster', 'british columbia', 'v3m 7a7', '604-526-8781', 'qbush@shaw.ca', 'We have a foursome headed your way on the weekend of June 4th.  Are the discount coupons available at Costco redeemable for all dates, or are there any restrictions?  As well, what''s the earliest date we can book for that weekend?\r\nThanks', '2010-03-27 19:24:47', '2010-03-27 19:24:47'),
(126, 'Calvin ', 'Jennings', '5523 Deerhorn Lane', 'Whistler', 'BC', 'V0N 1B2', '604 935 3200', 'calvin@jennings.ca', 'I have taken summer camps with the golf club for the past two years, and I am looking to buy a season pass for this summer. I am fifteen years old and wondering what ages the Junior Pass applies to. I am also curious by which date the pass needs to be purchased. If you could email me the response that would be greatly appreciated.\r\nThanks for your time. ', '2010-03-29 02:31:43', '2010-03-29 02:31:43'),
(127, 'George', 'Pollard', 'The Shrublands', 'Potters Bar', 'United Kingdom', 'EN6 2BN', '+447845196420', 'gpollard12345@hotmail.co.uk', 'Hello\r\n\r\nI am from England and am planning a golfing holiday in Canada during the summer months. I was just curious about how the best way to book a tee time would be, as I do not live in Canada or have BC drivers license, which I saw was required when checking in.\r\n\r\nMany Thanks\r\n\r\nGeorge Pollard', '2010-03-29 14:30:13', '2010-03-29 14:30:13'),
