(129, 'Jehane', 'Burns', '#203 - 2400 Dave Murray Place', 'Whistler', 'BC', 'V0N 1B2', '604.905.8095', 'jehanneburns@hotmail.com', 'To Whom It May Concern:\r\n\r\nI have signed up for the ladies clinic (session 4 or 5) but I will be unable to make that clinic and I was wondering if I could switch to the session 7 in June?\r\n\r\nCheers, Jehanne  ', '2010-04-06 19:45:27', '2010-04-06 19:45:27'),
