(134, 'Sheryl', 'Tank', 'Unit 1202, 161 Grey Street', 'South Brisbane', 'Australia', '4101', '', 'the.tanks@gmail.com', 'My sister-in-law, Marliss Thiessen, has booked a banquet dinner on Sunday May 23rd.  Is there somebody I can contact to enquire about the set up?  I''m hoping to surprise them with a bit of a programme and movie - but it''s only possible if she''s booked a private room and there''s a data projector/ screen.  Please advise a contact and phone number (not toll-free) that I can talk to about her booking.\r\n\r\nThanks,\r\nSheryl Tank', '2010-04-11 20:17:24', '2010-04-11 20:17:24'),
