(136, 'Martin', 'Faubert-Smith', '37 Humphrey Way', 'Ottawa', 'Ontario', 'k2l 2s9', '613 294-3683', 'mfaub014@hotmail.com', 'Hi, I am a third year university student from Ottawa.I am planning on\r\nmoving out to Whistler this summer. I have worked in the retail business\r\nfor over 5 years in Ottawa, selling mountain bikes, snowboards and various\r\nOakley, Smith and Spy accessories. I am bilingual and am recognized as\r\nhaving a real knack for sales. I am often the top seller of the day at my\r\ncurrent place of employment. I am very interested in determining\r\nwhether there would be any job opprutunities for me this summer at one of\r\nyour shops.\r\n\r\nPlease do not hesitate to contact me should you wish to discuss job\r\nopportunities with me.\r\n\r\nBest regards\r\n\r\nMartin Faubert-Smith\r\n(613) 592-3978\r\n', '2010-04-19 02:39:58', '2010-04-19 02:39:58'),
(137, 'Jason ', 'Millan', '95 West end ', 'lively', 'ontario ', 'p3y1h8', '1-705-562-4665', 'jmillan@uoguelph.ca', 'Good day!\r\nMy name is Jason Millan and I have recently graduated with a BComm in Hospitality and Tourism Management from the School of Management and Economics from the University of Guelph with final year honors. \r\nI am writing to you today to apply for an employment opportunity at one of your renowned courses. As my previous experience lends itself primarily to the hospitality industry, in conjunction with my past academic performances and an uncanny ability to be personable, approachable and friendly, I truly belive that I would be a strong asset to your organization in any capacity.\r\nI would be extremely appreciative to have the opportunity to discuss the possibility of employment with you in person. You can reach me anytime via the proceeding communication channels. Looking forward to hearing from you! \r\nSincerely,\r\n\r\nJason Millan, BComm\r\njmillan@uoguelph.ca \r\n1-705-562-4665\r\n', '2010-04-23 17:38:47', '2010-04-23 17:38:47'),
