(139, 'Jody', 'MacLeod', '#8 - 8138 cedar Springs Road', 'Whistler', 'BC', 'V0N 1B8', '604-962-5360', 'jodymacleod@telus.net', 'I am interested in purchasing an "A" season pass, but wasn''t able to find the link on your website to make the purchase prior to the May 1st deadline.The phone line did not have anyone available.\r\n\r\nCan you please let me know how I can purchase one?\r\n\r\nThanks very much!', '2010-04-25 02:04:35', '2010-04-25 02:04:35'),
(140, 'Reggie', 'Hayer', '442 East 55th Avenue', 'Vancouver', 'BC', 'V5X1N4', '604.771.6161', 'reggie.hayer@shaw.ca', 'Hello there,\r\n\r\nI''m curious to know if you will be opening this coming weekend. I am a BC resident and will be visiting the Whistler for this coming weekend May 1,2nd....and wonder if i should bring my clubs.\r\n\r\nPlease advise, Thanks.\r\n\r\nReggie Hayer.', '2010-04-26 17:33:59', '2010-04-26 17:33:59'),
