(142, 'marvin', 'hirano', 'box 2172', 'fernie', 'b.c.', 'V0B-1M0', '250-278-0064', 'gspot@xplornet.com', 'we had a membership at your club last season, we had ordered a nike driver early in the season, we had a loaner  because your employee at the range said the club would be received within a week, we were in whistler for 6 weeks and did not receive the club, we left and we paid for the driver and have not received it. wondering what the situation is with the club, please email us thank you m.hirano ', '2010-05-04 03:32:09', '2010-05-04 03:32:09'),
(143, 'Mark', 'Jukes', '30-6110 138st', 'Surrey', 'BC', 'v3x 3v6', '778-565-2607', 'majukes@telus.net', 'We are heading up there this weekend, and i was thinking of playing some golf. In the end it is just going to be me playing, and i could not seem to book online for just one person. I did get the email sent to me with the ecoupon of $59 green fee. Would i still be able to get that rate if i just popped in sometime on saturday morning??', '2010-05-04 16:19:35', '2010-05-04 16:19:35'),
