(148, 'Lucinda', 'VanderMolen', '3341 Panorama Ridge', 'Whistler', 'BC', 'V0N 1B3', '', 'lucinda_k@yahoo.com', 'Hello\r\n\r\nI would like to sign my 8-year old son up for golf lessons.  He''s a beginner, with probably 6 hours of basic golf training before.  I notice on your program that your classes for those in in age group are listed as ''Intermediate".  As he would NOT want to be in a group with young kids, can you advice if Intermediate class would still suit him, and if not, what are the alternatives?\r\n\r\nThanks,\r\nLucinda', '2010-05-13 02:13:37', '2010-05-13 02:13:37'),
(149, 'Randall', 'Skaar', '3260 Carriage drive', 'Medina', 'Minnesota, USA', '55340', '', 'randall@skaar.com', 'I don''t have a confirmation for my June 21st, 2:00 PM tee time.  Could you please email me a confirmation?  thanks.', '2010-05-19 11:33:41', '2010-05-19 11:33:41'),
(150, 'Katy', 'Fahey', 'Unit 237 105-4360 Lorimer Rd', 'Whistler', 'BC', 'V0N 1B4', '604-966-6185', 'sway_1987@hotmail.com', 'Hello , \r\n\r\nI work at Mountainside Lodge as a concierge/Front desk agent and i havent had a chance to contact you in regards to current prices / promotions etc .\r\nAlso are you doing any concierge specials as my father is in town visiting this weekend and i would love to take him for a round on your golf course . Is there any deals that you could assist me with ?\r\nThank you . ', '2010-05-21 02:51:36', '2010-05-21 02:51:36'),
(151, 'Jason', 'Scott', '', '', '', '', '', 'jlsprofit@yahoo.com', 'Hello,\r\nI''m currently in the process of moving over to Vancouver mid August.  I''d like to introduce myself to you and your staff and members when I arrive if you''d allow me to.\r\nHave you got any facilities for fitness at the golf club?\r\nI''m a keen golfer, handicap of 11, and I have trained some European tour golfers to help with their careers.\r\nI''d really love to come and visit your course, and to talk to you on my arrival to discuss a possibility of adding a revenue stream to your business and benefiting your members.\r\n\r\nWould you consider something like this?\r\n\r\nKind regards\r\n\r\nJason Scott \r\n\r\nPersonal Trainer\r\n\r\nwww.jlsprofit.co.uk\r\n\r\n', '2010-05-25 18:27:45', '2010-05-25 18:27:45'),
(152, 'Jason', 'Scott', '', '', '', '', '', 'jlsprofit@yahoo.com', 'Hello,\r\nI''m currently in the process of moving over to Vancouver mid August.  I''d like to introduce myself to you and your staff and members when I arrive if you''d allow me to.\r\nHave you got any facilities for fitness at the golf club?\r\nI''m a keen golfer, handicap of 11, and I have trained some European tour golfers to help with their careers.\r\nI''d really love to come and visit your course, and to talk to you on my arrival to discuss a possibility of adding a revenue stream to your business and benefiting your members.\r\n\r\nWould you consider something like this?\r\n\r\nKind regards\r\n\r\nJason Scott \r\n\r\nPersonal Trainer\r\n\r\nwww.jlsprofit.co.uk\r\n\r\n', '2010-05-25 18:29:23', '2010-05-25 18:29:23'),
(153, 'Bobby', 'Nishi', '33 - 10391 No. 3 Road', 'Richmond', 'BC', 'v7a4v2', '604-812-2627', 'nishbo@shaw.ca', 'I was going through some of my files and came across 2 gift certificates valid Mon - Thurs after 12:00 (5523, and 5524).  I got the gift certificates from the Marriott Silent Auction.  The issue is that the gift certificates expired "end of the 2008 season".  My wife and I had a baby during the summer of 2008 so were not able to use them and forgot about them.  I was wondering if it was possible to extend the certificates through the summer of 2010, as I would really like to play the Whistler course.  Please let me know.\r\n\r\nThank you,\r\n\r\nBobby Nishi', '2010-06-02 21:27:38', '2010-06-02 21:27:38'),
(154, 'Dave', 'Townshend', '#501/1608 Yew St', 'Vancouver', 'BC', 'V6K 3E7', '', 'davetownshend@hotmail.com', 'Hi. We are a group of 6 looking to play on Saturday. Do you rent clubs and shoes (if required)?\r\nthanks, Dave.', '2010-06-10 19:44:54', '2010-06-10 19:44:54'),
(155, 'Paul', 'Harris', '#403 1055 Hillside Ave', 'Victoria', 'BC', 'v8t 2a4', '250 381 8288', 'paul_harris@canada.com', 'Hello just want to say thanks very much for the opportunity to go to the Skins Game. Wondering if you might be able to tell me what courier company I should be expecting and when do you think the ticket will arrive. Again thanks so much!', '2010-06-15 23:37:56', '2010-06-15 23:37:56'),
(156, 'JIN', '', '', 'Whistler', '', '', '', 'porsche973@gmail.com', 'Hi,\r\nWhen the driving range opens?', '2010-06-16 07:04:17', '2010-06-16 07:04:17'),
(157, 'Lily', 'Rivers', '', '', 'British Columbia', '', '', 'littlelil@shaw.ca', 'Hi, my name is Lily, I was volunteering with the Squamish Nation Event yesterday.  Had a wonderful day out there!  Please pass along a big Thank You to Brett for his outstanding friendliness and a job well done.  : )  ', '2010-06-20 04:56:52', '2010-06-20 04:56:52'),
(158, 'Mario', 'Rota', '7863 Progress Way', 'Delta', 'BC', 'V4G1A4', '604 250 4699', 'mario@brockmannchocolate.com', 'Good Morning Whistler G&CC!\r\n\r\nFor the past 8 years I''ve been bringing clients up to Whistler for a few days to golf but have never played your course. We''ve played the other 3 (including Big Sky) and was wondering if there was a special offer for 6 of us to play your course on July 10th. I see that there is a BC resident rate of $109...Can you offer something else?\r\nLooking Forward to hearing back from you.\r\n\r\nMario Rota\r\nVP Sales & Marketing\r\nTruffini Chocolate', '2010-06-22 14:46:22', '2010-06-22 14:46:22'),
(159, 'Daniella', 'Gentile', '', 'North Vancouver', 'BC', '', '604-785-0432', 'daniella@bodwell.edu', 'Hello,\r\nI''d like to find out about bringing a school group to the driving range this summer. Every year for the last few years we have brought a group of students and we would like to do the same this summer. I tried to contact the contact from last year, Paul, but have not heard back. Please let me know if we can bring our group again this year and who the contact is. Thanks!', '2010-06-22 21:57:39', '2010-06-22 21:57:39'),
(160, 'Susan', 'Spampinato', '10 Kingview Crescent', 'King city', 'Ontario', 'L7B 1K5', '(905) 727-1138', 'susanspampinato@sympatico.ca', 'Goodmorning Madeline,\r\n\r\nI spoke with you yesterday regarding my booking on Sept.16, 2010 for 4 people at 1:00pm which you booked for me and you said you would be sending me confirmation yesterday and was wondering if maybe you had the wrong email address so I''m just emailing you my correct one just in case the one I gave you was incorrect. Thank you very much and have a wonderful day. Looking forward to coming down. Regards Susan Spampinato', '2010-06-28 11:00:52', '2010-06-28 11:00:52'),
(161, 'Troy ', 'Dunning', '4461 Interurban Rd', 'Victoria', 'B.C.', 'V9E 2C1', '(250) 370-4168', 'dunning@camosun.bc.ca', 'Good evening Alan.\r\n\r\nTroy Dunning here from Camosun College''s Golf Management program.  I am inquiring about the possibility of myself coming to play as a single at Whistler Golf Club.  \r\n\r\nMy family and I are taking advantage of some very affordable hotel promotions and we are coming to Whistler for three days.\r\n\r\nI have never played your facilty and the many years that I was doing Co-op onsites for students in the area did bring me to your facility for on-site visits but I never took the opportunity to play Whistler Golf Club.  I remember speaking with Luc Binnette who I see is still employed on your team and he raved about the course.  I have played the other courses in the Whistler/Pemberton area and would like the opportunity to play the Palmer designed layout.\r\n\r\nI am looking at Monday July 12.  We are staying at the Adara Hotel which is a short distance from the course and I am hoping to play first thing in the morning as a single, and more than happy to golf with others.\r\n\r\nI have my 2010 CPGA card as an Affiliate Professional and hope that I can receive approval from yourself to play.  If accepted perhaps you can indicate what is the first tee time you start and I will report to your proshop and hopefully find others to join for a round.\r\n\r\nThanks for your time in reading this Alan and if you can reply back at your soonest convenience.\r\n\r\nHave a great day and prosperous 2010 season .\r\nAlan.\r\n\r\nTroy Dunning, CPGA\r\nProgram Leader - Hospitality, Tourism, & Golf Management.\r\nCamosun College School of Business. ', '2010-06-29 04:52:47', '2010-06-29 04:52:47'),
(162, 'Brian', 'Johnson', '3445 Calaway Drive', 'Washougal', 'Washinton, USA', '98671', '503-882-9734', 'brianj62@comcast.net', 'Hello,\r\nI am coming up there this month and want to play some golf. I know you have rental clubs for the course. But do you also have rentals for the driving range and the putting and chipping areas?\r\nThanks!\r\n\r\nBrian Johnson', '2010-07-02 04:25:42', '2010-07-02 04:25:42'),
(163, 'Brian', 'Lutke', '14-6320 Lorimer Road', 'Whistler', 'Bc', 'V0N1B6', '604-932-9796', 'blutke@whistler.ca', 'I wanted to know if there was any plan to have another Introduction to Golf Clinic scheduled to begin in July.\r\n\r\nThanks,\r\nBrian', '2010-07-06 20:26:54', '2010-07-06 20:26:54'),
(164, 'Brian', 'Finley', '', 'Squamish', 'BC', '', '604-892-0288', 'blfin@shaw.ca', 'Good Afternoon\r\nI am organising a family reunion for July 2011.  At these events we usually have a little family golf tournament.  The date would be morning of Friday July 15th 2011 and I would expect 4-5 foursomes.  Could this be held at Whistler Golf Club?  With the normal longest drive, closest to the pin etc.  If this is on, what would be a budget price per player (just golf, no food or extras), also what is the cost of club rental and cart rental.\r\n\r\nThanks\r\nBrian\r\n', '2010-07-08 22:19:09', '2010-07-08 22:19:09'),
(165, 'Beat', 'Burlet', '7412 4th Ave NE', 'Seattle', 'WA', '98115', '4252686352', 'bburlet@hotmail.com', 'Hello,\r\n\r\nI played your beautiful course last year and I forgot to buy a golf shirt in you pro shop. So I was wondering if it would be possible to order one of you logo golf shirts?\r\n\r\nI am interested in a white Nike Dri-FIT Golf Polo, Size small with your Whistler Golf Club logo on it.\r\n\r\nI appreciate your help.\r\n\r\nBest regards,\r\n\r\nBeat Burlet (bburlet@hotmail.com)', '2010-07-09 15:43:26', '2010-07-09 15:43:26'),
(166, 'Larry', 'Eiben', '', '', '', '', '604 790 0204', 'leiben@thenewsgroup.com', 'Have a 4 some for July 14th @ 2:40 under my name\r\nDue to a scheduling conflict I am going to have to cancel.\r\nMy confirmation # - kh7m1429\r\n\r\nPlease confirm to my email address or my cell.\r\nThanks Larry', '2010-07-11 04:05:43', '2010-07-11 04:05:43'),
(167, 'Jordan ', 'Peterson', '', 'Menomonie', 'WI', '', '920-207-9209', 'petersonjo@my.uwstout.edu', 'Good Afternoon, \r\nMy name is Jordan Peterson and I am currently studying business management as well as golf enterprise management at the University of Wisconsin-Stout.  I''m currently an intern at Wild Rock Golf Club in wisconsin dells, wi.  Wild Rock is on of the top 5 courses in the entire state of wisconsin and recognized nationally as a top 5 course in the entire nation.  I am wondering if Whistler offers summer internships.  I would be very interested in an opportunity to come there and pursue the golf industry.  Thanks for your time, \r\nJordan ', '2010-07-15 02:04:58', '2010-07-15 02:04:58'),
(168, 'Leah ', 'Gillies', '4272 Mountain Square', 'Whistler', 'BC', 'v0n1b4', '604-932-3330', 'info@sushivillage.com', 'Hi,\r\n\r\nI am the GM of Sushi Village and we were trying to organize a small staff golf tournament. It would be between 16-20 people. we were looking at doing it on September 8th. Would you be able to give us a group rate? Is that date available? Feel free to call Sushi Village 604-932-3330 and speak with Naoko or myself about setting this up. Or email at info@sushivillage.com \r\n\r\nThank you!\r\n\r\nLeah Gillies\r\nGeneral Manager\r\nSushi Village\r\n', '2010-07-19 01:40:01', '2010-07-19 01:40:01'),
(169, 'Golfcoursesguide.org', '', '', '', '', '', '', 'maridc.cano@gmail.com', 'Hello,\r\n\r\nI visited your website http://www.whistlergolf.com and I found it interesting with a good content. I would like propose make a reciprocal link exchange between our web sites-Our collaboration could be mutually beneficial helping to increase the website traffic and popularity of both our sites!\r\n\r\nIf you agree, send to us your information and we will link your website immediately. These are our details to link back:\r\n\r\nURL: http://www.golfcoursesguide.org\r\nTitle: Golf\r\nDescription: Worldwide golf courses guide with full details and golfers reviews.\r\n\r\nAnd if you have any question please contact me\r\n\r\nKind regards\r\n\r\nMaria del Carmen Cano\r\nmaridc.cano@gmail.com', '2010-07-20 22:47:26', '2010-07-20 22:47:26'),
(170, 'Otto', 'Forgacs', '1843 Acadia Road', 'Vancouver', 'BC', 'V6T 1R2', '604 224-5861', 'oforgacs@telus.net', 'I regret that I have to cancel my tee-time booking for 4 players on Wednesday, August 11. I hope to be able to re-book a round later in the summer.\r\nKindly acknowledge that this reservation has been cancelled.', '2010-07-21 00:01:43', '2010-07-21 00:01:43'),
