(178, 'Enrico', 'Bertucci', '1204-1010 richards', 'vancouver', 'bc', 'v6b1g2', '604 683 7183', 'enrico.o.b@gmail.com', 'Hi how are you?\r\n\r\nI recently won a contest staged by Stanely Park Brewing. The prize includes green fees for four at the whistler golf course!!!\r\n\r\nI was told that to claim this prize I was to get in touch with your Food and Beverage manager Adrian.\r\n\r\nCould you please let me know the best way to get in touch with Adrian?\r\n\r\nThank you\r\n\r\nEnrico Bertucci.', '2010-08-13 22:23:33', '2010-08-13 22:23:33'),
