(183, 'Travis', 'Feldmann', '1771 Pekrul Place', 'Port Coquitlam', 'BC', 'V3C6A7', '(604) 942-8654', 'humanmunky@hotmail.com', 'Hi,\r\n\r\nI have 4 Gift Certificates for a round of golf including carts that I would like to reserve a tee time on Monday September 6th, 2010 for around noon.\r\n\r\nPlease get back to me.\r\n\r\nThanks \r\n\r\nTravis', '2010-08-26 07:32:53', '2010-08-26 07:32:53'),
(184, 'Jenessa', 'Karr', '4610 Freimuller Avenue', 'Prince George', 'BC', 'V2M 6V3', '250-614-3782', 'jjoneson@sd57.bc.ca', 'Hello.  \r\nI just wanted to thank you for having such a beautiful venue for weddings.  We were married on the wedding knoll on July 25th and loved every minute of it.  Your staff was kind, courteous, and went above the call of duty when my dress would not unbustle.  We thoroughly enjoyed our time at the course and would recommend it to any others that were thinking of holding there weddings at this venue.  \r\n\r\nJenessa and Dan Karr\r\n\r\nI would like to warn you not to include our photographer, Rafal Studio, on your list of preferred vendors though.  He was overbearing and the photos that he produced were not of the quality we were expecting.\r\n', '2010-08-26 23:27:06', '2010-08-26 23:27:06'),
(185, 'Richard', 'Hall', '56 Quaker Street', 'London', 'London, UK', 'E1 6ST', '00447729292905', 'richardalexanderhall@yahoo.co.uk', 'Dear Sir/Madame,\r\n\r\nI am visiting Whistler in September from the UK.  Myself and 3 friends are keen amateur golfers here in the UK and wanted to inquire if non-members can play 9 holes at your club?\r\n\r\nWe''d love to play some golf while staying in Whistler.  Are you open on Sunday''s?\r\n\r\nBest,\r\n\r\nRich Hall ', '2010-09-02 11:40:58', '2010-09-02 11:40:58'),
(186, 'Sarah', 'Welch', '4170 Nanaimo Street, Apt. 205', 'Vancouver', 'BC', 'V5N5H7', '7789684513', 'josh.sarahwelch@gmail.com', 'Hi,\r\n\r\nI was wondering if a BC Drivers Licence is the only accepted BC Identification when booking a round of golf as a BC resident. My husband has a three year work permit in Canadada and an MSP card but does not drive in Canada so has not changed over his licence. If I book a round of golf for him will his work permit be acceptable as evidence of his BC residency?\r\n\r\nThank you,\r\n\r\nSarah Welch', '2010-09-09 16:17:55', '2010-09-09 16:17:55'),
(187, 'Paula ', 'Tucker', '', '', '', '', '', 'patrick.nortoni11@gmail.com', 'We noticed that you are not at the top of the search engines for a number of your key terms. We have helped companies similar to yours to achieve top organic rankings. Please reply to this message and we will prepare a special proposal for you, to show you how we can achieve similar results for you.', '2010-09-15 09:10:49', '2010-09-15 09:10:49'),
(188, 'David', 'Grant', '70 Durant Avenue', 'Toronto', 'Ontario', 'M4J 4W2', '416-803-8584', 'david.grant@sympatico.ca', 'Hello,\r\nI am going to be in Whistler on October 6 and wold like to get a round in with a tee off time of 8/9am.  I am a single golfer.\r\n\r\nI tried to reserve a time bu could not seem to find any time available.\r\n\r\nCould you please book me in to tee off around this time early in the morning?\r\n\r\nThanks', '2010-09-16 02:48:09', '2010-09-16 02:48:09'),
(189, 'Martin', 'Auyeung', '4036 Lister Court', 'Burnaby', 'BC', 'V5G 2C2', '6046498933', 'mca@lightspeed.ca', 'I am planning to come up the first weekend in October.  I was wondering when the course Aeration is scheduled. Will it be after this weekend?\r\n\r\n', '2010-09-17 22:42:33', '2010-09-17 22:42:33'),
(190, 'Bénédicte', 'Masse Desjardins', '', 'Montreal', '', '', '', 'bmdesjardins@productionsj.com', 'Hi!\r\n\r\nUntil what date your range and the course stil open?\r\nThanks!', '2010-09-21 05:25:44', '2010-09-21 05:25:44');
