(209, 'Val', 'Heuman', '7828 OK Landing Bench Rd.', 'Vernon', 'BC', 'V1H1H3', '250-308-4830', 'heuman@shaw.ca', '          My name is Val Heuman and while I was holidaying in your area this summer, I became aware of the exciting opportunity for a truly exciting golf experience that you offer.  I belong to a Rotary Club in Vernon BC which holds an annual “Dream Auction Dinner Gala” fundraiser where we usually raise over $120,000.00 in one evening to be distributed to worthwhile charities locally, nationally and internationally. Each member is encouraged to find interesting items or experiences which can be auctioned off during the evening while showcasing various recreational opportunities in BC. The event is attended by the most influential and affluent members of the Okanagan Valley community which makes it a good place to showcase the products and services offered in our province.\r\n          I would be very grateful if your golf club would be able to donate a “Whistler Unlimited Golf Package” for two adults  to auction at this event. Please e-mail me at heuman@shaw.ca to receive a donation form.\r\nI hope you will take this opportunity to awaken the Okanagan Valley to the wonderful golfing experience that you provide. Thank you for considering this invitation to partner with the Rotary in its pursuit of building stronger communities. \r\n', '2010-10-07 15:26:23', '2010-10-07 15:26:23'),
