(223, 'Dave', 'Marsh', '118 Lincolnshire Dr', 'Fall River', '', 'B2T 1P7', '902 482-3900', 'dj2000@eastlink.ca', 'Hello\r\n\r\nI played your course Sept. 13th. I left my Drivers licence there when I demoed a Driver, and unfortunately it has not been forwarded. We were booked approximately 3:30PM under Nagle, Corby & Marsh.\r\n\r\nCould you advise me if you have found it and if so you can forward it to:\r\n118 Lincolnshire Dr, Fall River, NS B2T 1P7 \r\n\r\nThanks Dave Marsh\r\n902 482-3900\r\n\r\nPS The Drivers Licence has my old address: 26 Acorn Dr, Oakfield, NS', '2010-10-21 15:57:49', '2010-10-21 15:57:49'),
(224, 'Jesse', 'Miller', 'Box 53', 'Britannia Beach', 'BC', 'V0N 1J0', '', 'bbgst@britanniags.com', 'October 28 2010\r\n\r\n \r\n\r\nAttention: To whom it may Concern\r\n\r\n \r\n\r\nThe Britannia Beach Community Association is holding a fundraiser for the Britannia Beach Firemen Association.  This will be the second annual Firemen’s Ball to be held in Britannia Beach at the community hall in November 13 2010\r\n\r\nWe are requesting a donation for our silent auction table, with proceeds going towards the community projects and the Fireman’s Association.\r\n\r\nThank you for your consideration in helping with this fundraiser.\r\n\r\nMuch appreciated,\r\n\r\n \r\n\r\n \r\n\r\nBritannia Beach Community Association\r\nFax:6048962355\r\nEmail: bbgst@britanniags.com\r\n', '2010-10-28 18:47:51', '2010-10-28 18:47:51'),
(225, 'Ian', 'Harris', '', 'Narooma', 'Australia', '2546', '', 'pump28kin@hotmail.com', 'We will be in Whistler for one day in may 2011, I would like to play a round of golf do you have club hire?\r\n\r\nRegards', '2010-11-21 08:58:28', '2010-11-21 08:58:28'),
(226, 'Chris', 'Cullum', '2838 W 13th Ave', 'Vancouver', 'BC', 'V6K 2T7', '604-736-5577', 'chris_cullum@yahoo.ca', 'Hi, I am organizing a birthday present for my father in law that lives in Quebec. I would like to take him up to Whistler for a round of golf at one of the Whistler courses. I would like to put together a package to give him in advance. Would it be possible to mail me some score cards and brochure from the course that I could present to him as his golf present.\r\n\r\nThanks,\r\n-Chris', '2010-11-25 22:59:22', '2010-11-25 22:59:22'),
(227, 'Charlene', 'Warrington', '3263 West 38th Avenue', 'Vancouver', 'British Columbia', 'V6N2X5', '', 'cwar@telus.net', 'What are your golf and stay packages rates for 2011? Looking to purchase 2 rounds, one night, for two people...', '2010-12-07 01:17:00', '2010-12-07 01:17:00'),
(228, 'Dorothy', 'Newton', '6212 164th Ave. S.E.', 'Bellevue', 'Washington ', '98006', '425-747-4128', 'dotnewton@yahoo.com', 'In your golf shop do you have two each of the Whistler Bear head covers.\r\nPlease advise.  Thank you', '2010-12-09 17:15:29', '2010-12-09 17:15:29'),
