(231, 'Cristy Ruth', 'Barsky', 'PO 1148', 'Hood River', 'Oregon', '97031', '541-490-3124', 'cristy.r.barsky@centurylink.com', '1. I am a life long fan of Mr. Palmer.  Just Saying!  2.  I am coming to the Outgames this summer to play in the golf event.  Could you perhaps tell me if you have a non-digital yardage book?  The online site is terrific, but i guess i am old school when it comes to a yardage book.  If you can let me know if I can order one that would be terrific.  I plan on arriving a week or so early (July), and hope to get a lot of time on the course.  Thank you for this venue! Cristy Barsky', '2010-12-24 03:00:31', '2010-12-24 03:00:31'),
(232, 'Dylan', 'Walker', '3514 Scott St.', 'San Francisco', 'CA', '94123', '415.533.7151', 'dwalker@insoundmedical.com', 'I''m getting married up at Lost Lake Park next August and was hoping to get a round in with my groomsmen on the Wednesday before the festivities kick off.\r\n\r\nIs it possible to book two back to back tee times for four people each (total of 8 people playing) for around 1:30pm on Wednesday, August 3rd?\r\n\r\nRegards,\r\nDylan Walker', '2010-12-31 02:18:59', '2010-12-31 02:18:59'),
(233, 'Phil ', 'Wraith', '26 Blackwell', 'Darlington', 'Durham', '', '', 'wraith577@btinternet.com', 'We are a party of 4 looking to holiday in Whistler late August/early September. We are keen golfers from the UK and would like to play your course. We would be staying at either the Fairmont or Hilton. How much would the green fee be and how can we book in advance.', '2010-12-31 12:55:00', '2010-12-31 12:55:00'),
(234, 'aswdatg', 'aswdatg', 'hdgcfNwkAWkURcsH', 'BXnvZIXMVj', 'CdkzvwxGVMg', 'aZAfmMQCUnZqEtXb', 'trxEqYJqJXba', 'rhatbm@cuqonl.com', 'kr6BRs  <a href="http://wrkgstplatht.com/">wrkgstplatht</a>, [url=http://gszxwowocsxl.com/]gszxwowocsxl[/url], [link=http://ofrzrcvmffpo.com/]ofrzrcvmffpo[/link], http://ftnrcpkplqsu.com/', '2011-01-03 13:33:07', '2011-01-03 13:33:07'),
(235, 'aswdatg', 'aswdatg', 'hdgcfNwkAWkURcsH', 'BXnvZIXMVj', 'CdkzvwxGVMg', 'aZAfmMQCUnZqEtXb', 'trxEqYJqJXba', 'rhatbm@cuqonl.com', 'kr6BRs  <a href="http://wrkgstplatht.com/">wrkgstplatht</a>, [url=http://gszxwowocsxl.com/]gszxwowocsxl[/url], [link=http://ofrzrcvmffpo.com/]ofrzrcvmffpo[/link], http://ftnrcpkplqsu.com/', '2011-01-03 13:33:08', '2011-01-03 13:33:08'),
(236, 'Sarah', 'Smith', '1210 Washington Blvd', 'Abilene', 'TX, USA', '79601', '5073124176', 'sks08a@acu.edu', 'My fiance and I are getting married August 2011 and are honeymooning in Whistler! He is an avid golfer and I wanted to surprise him with a few holes of golf while we are there. The "5 after 5" deal seemed like the best option for us. I was wondering if we had to book a tee time and if you had any available times for any day of the week, Monday through Thursday, of August 8-11. Thanks, Sarah Smith', '2011-01-06 05:28:27', '2011-01-06 05:28:27'),
(237, 'paul', 'courtney', '1956 e. 3rd ave', 'vancouver', 'bc', 'v5h 4h1', '604-787-0619', 'paul@courtney.ca', 'Do you have season pass/10 pass rates for B.C. Residents? How about it you have a place in Whistler, is there further discounts?\r\nThanks,\r\nPaul.', '2011-01-09 21:26:52', '2011-01-09 21:26:52'),
(238, 'John', 'Houwen', '', 'Perth', 'Australia', '', '', 'john127@ozemail.com.au', 'Hello\r\nMy nephew Garrett Chapell and his partner Leon are holding their wedding reception at your golf club house this Wednesday 12th January. Can you tell me if wireless internet is available at the reception. My 2 daughters are attending the wedding and have a laptop that we would like to connect to from Australia, so that we can pass on our wishes to the couple.\r\nKind Regards\r\nJohn Houwen ', '2011-01-10 00:54:48', '2011-01-10 00:54:48');
INSERT INTO `contents` (`id`, `title`, `text`, `created_at`, `updated_at`, `attachment_file_name`, `attachment_content_type`, `attachment_file_size`, `attachment_updated_at`) VALUES
(1, 'Players Club Booking Link', 'http://book.golfswitch.com/webPro/yield.asp?CUSTID=WPC&COURSEID=FOR1210', '2009-03-04 06:04:34', '2009-04-28 21:34:41', '', '', 0, '0000-00-00 00:00:00'),
(2, 'Players Club Booking Info', '<h2>PLAYERS'' CLUB BOOKING TIPS</h2>\r\n\r\n<p>If you see a rate you like, book it as the rates are updated every 5 minutes so I can''t guarantee the great rate you see will stay for long!! Special rates will continue to be available all season long two weeks out from that day''s date.  To check available times first select number of players. Then pick the day and approximate time you want to play and hit the appropriate search icon. From there simply book your time online. ALL PLAYER''S MUST BE PLAYER''S CLUB MEMBERS TO RECEIVE THE MEMBER ONLY RATES. BC OR WASHINGTON STATE I.D WILL BE REQUIRED UPON CHECK IN</p>', '2009-03-04 06:04:35', '2009-06-23 23:49:26', '', '', 0, '0000-00-00 00:00:00'),
(3, 'Players'' Club Content', '', '2009-03-04 06:04:35', '2009-04-29 05:03:51', '', '', 0, '0000-00-00 00:00:00'),
(4, 'Passholders Specials', '<h2>Specials</h2>\r\n\r\n<p>Bring a guest anytime during the Summer season for $69. Bookings with guests Monday to Friday can be made 7 days in advance for Standby and twilight pass holders. For weekend and holiday play with a guest Standby and Twilight passholders may book after 5pm the day before play. Palmer passholders may book 7 days in advance when bringing a guest or guests on weekends or holidays.</p>', '2009-03-04 06:04:35', '2010-07-07 16:39:23', '', '', 0, '0000-00-00 00:00:00'),
(5, 'Passholders Upcoming Events', '<h2>Upcoming Events</h2>\r\n\r\n<p><p>Reminder of the "one ball" rule on the golf course. The Range is now open. Please use it for your practice. Thanks<p></p>', '2009-03-04 06:04:35', '2010-08-18 18:37:46', '', '', 0, '0000-00-00 00:00:00'),
(6, 'Passholders Other Information', '<h2>Other Info</h2>\r\n\r\n<p><strong>Note</strong> We are currently experiencing trouble with the link above. Please use the following:\r\n<h2><a href="http://book.golfswitch.com/webpro/search.asp?CUSTID=WHP&amp;COURSEID=FOR~1210"class="lightwindow booking&#95;link" params="lightwindow&#95;width=805">BOOK PASSHOLDER TEE TIME NOW</a></h2></p>\r\n\r\n<p>UPCOMING COURSE CLOSURES</p>Course closed for event Octover 1st. 11am shotgun starts only October 7 and 8. Note the range closed October 3rd. Regular tee times may turn into a 11am shotgun start if there is serious frost.</p>', '2009-03-04 06:04:35', '2010-09-24 15:20:45', '', '', 0, '0000-00-00 00:00:00'),
(7, 'Contest Callout', '<p>GOLF FOR <span>YOU AND 19</span> <span>FRIENDS</span> </p>', '2009-03-24 06:33:52', '2009-04-29 05:24:39', '', '', 0, '0000-00-00 00:00:00'),
(8, 'Contest Title', '<p>Arnie’s Army Golf Giveaway</p>', '2009-03-24 06:34:17', '2009-04-29 04:34:10', '', '', 0, '0000-00-00 00:00:00'),
(9, 'Content Description', '<p>Enter to win golf for you and 19 of your friends at the Whistler Golf Club in 2011</p>\r\n\r\n<p><strong>Grand Prize includes:</strong></p>\r\n\r\n<ul>\r\n<li>Golf for 20 players at the Whistler Golf Club including carts</li>\r\n<li>Complimentary practice balls at the driving range for all golfers</li>\r\n</ul>', '2009-03-24 06:34:42', '2010-11-27 00:42:11', '', '', 0, '0000-00-00 00:00:00'),
(10, 'Group Outing Confirmation Email', '<p>A Big Thank You for requesting information on Golf Group Outings at the Whistler Golf Club. Our Sales team will be in touch shortly to discuss your request. Did you know:</p>\r\n<ul>\r\n<li>The Whistler Golf Club is the leading golf group outing facility in Whistler.</li>\r\n<li>We are perfectly located in the heart of Whistler Village within walking distance from most hotels.</li>\r\n<li>We have access to the best hotel rates in Whistler.</li>\r\n<li>We are the 27th ranked public/resort course in Canada, according to the Globe and Mail Golf rankings.</li>\r\n<li>In our guest survey, 100% of our group guests said they would recommend our facility to others.</li>\r\n<li>We can custom build any food and beverage menu or prize table to fit your needs.</li>\r\n</ul>\r\n\r\n<blockquote><span class=''open&amp;#95;quote''/>I wish all golf courses were like yours! Thanks for a great couple of days!<span class=''close&amp;#95;quote''/><cite><b>ADP</b> (hosted 6 consecutive incentive shotguns for North American sales leaders)</cite></blockquote>\r\n<h3>ASK HOW YOU CAN GET A SLEEVE OF BALLS AND A BUFFET FOR ONLY $10 PER PLAYER!!</h3>\r\n\r\n\r\n<p>\r\nSincerley <br>\r\nRo Davies<br>\r\nSALES MANAGER<br>\r\n604-938-5886<br>\r\n<a href=''mailto:&amp;#x72;&amp;#x6F;&amp;#x40;&amp;#x77;&amp;#x68;&amp;#x69;&amp;#x73;&amp;#x74;&amp;#x6C;&amp;#x65;&amp;#x72;&amp;#x67;&amp;#x6F;&amp;#x6C;&amp;#x66;&amp;#x2E;&amp;#x63;&amp;#x6F;&amp;#x6D;''>ro@whistlergolf.com</a>\r\n</p>\r\n', '2009-03-29 04:41:28', '2009-04-29 03:31:20', '', '', 0, '0000-00-00 00:00:00'),
(11, 'Wedding Event Confirmation Email', '    \r\n      \r\n      <p>Thank you for requesting information on weddings at the Whistler Golf Club. Our Sales team will be in touch shortly to discuss your request. Did you know:</p>\r\n\r\n      <ul>\r\n      <li>We specialize in weddings from 50-150 people.</li>\r\n      <li>We offer the best wedding value in Whistler.</li>\r\n      <li>Our wedding knoll is situated in the heart of the golf course with 360-degree views of the surrounding peaks.</li>\r\n      <li>We can customize a food and beverage menu to fit your budget.</li>\r\n      </ul> \r\n\r\n       <blockquote><span class=''open_quote''/>"The beautiful scenery and excellent support staff made our wedding a dream come true."<span class=''close_quote''/><cite><b>John and Dawn Scarth</b> </cite></blockquote>\r\n\r\n      <h3>ASK ABOUT OUR FREE WEDDING VENUE OFFER!!</h3>\r\n\r\n\r\n      <p>\r\n      Sincerely<br>\r\n      Suzy Downing<br>\r\n      Wedding Specialist<br>\r\n      604-938-5888<br>\r\n      <a href=''mailto:&#x73;&#x75;&#x7A;&#x79;&#x40;&#x77;&#x68;&#x69;&#x73;&#x74;&#x6C;&#x65;&#x72;&#x67;&#x6F;&#x6C;&#x66;&#x2E;&#x63;&#x6F;&#x6D;''>suzy@whistlergolf.com</a>\r\n      </p>\r\n    \r\n    ', '2009-03-29 04:41:28', '2009-04-28 22:35:28', '', '', 0, '0000-00-00 00:00:00'),
(12, 'Player Confirmation Email', '<p>Thank you for joining the Whistler Golf Club''s Players'' Club! Your Player''s Club web site is www.whistlergolf.com/pc .  Simply enter your email and password in the member sign in to access two weeks of unbeatable Player’s Club member only green fee rates.</p>\r\n\r\n<p>If you see a rate you like, book it as the rates are updated every 5 minutes and based on availability so we can''t guarantee the great rate you see will stay for long! Special rates will continue to be available all season long, two weeks out from that day''s date.</p>\r\n\r\n<p>To check available times first select number of players. Then pick the day and approximate time you want to play and hit the appropriate search icon. From there, simply book your time online. ALL PLAYER''S MUST BE PLAYER''S CLUB MEMBERS TO RECEIVE THE MEMBER-ONLY RATES.  **BC OR WASHINGTON STATE I.D. WILL BE REQURIED AT CHECK-IN.**</p>\r\n\r\n<p>Have fun and we''ll see you soon.</p>\r\n\r\n<p>Sincerely <br />\r\nRo Davies<br />\r\nSales Manager <br />\r\n604-932-3280</p>', '2009-03-29 04:41:28', '2009-07-22 14:45:49', '', '', 0, '0000-00-00 00:00:00'),
(13, 'Employment Content', '<p>We are currently accepting resumes for the 2011 season.<br />See below for more information.</p>\r\n\r\n<h2>GUEST SERVICES and GOLF SHOP</h2>\r\n\r\n<ul>\r\n<li>Guest Hosts</li>\r\n<li>Golf Shop staff</li>\r\n<li>Retail Sales staff</li>\r\n</ul>\r\n\r\n<p>Please forward your resume to Luc Binette at <a href="mailto:luc@whistlergolf.com">luc@whistlergolf.com</a></p>\r\n\r\n<h2>MAINTENANCE</h2>\r\n\r\n<ul>\r\n<li>Grounds Crew</li>\r\n</ul>\r\n\r\n<p>Please forward your resume to Stu Carmichael at <a href="mailto:stu@whistlergolf.com">stu@whistlergolf.com</a></p>\r\n\r\n<h2>FOOD AND BEVERAGE</h2>\r\n\r\n<ul>\r\n<li>Servers</li> \r\n<li>Lead Servers</li> \r\n<li>Refreshment Car hostess</li> \r\n<li>Crab apple Corner hostess</li> \r\n<li>Lead Cooks</li>\r\n<li>Line Cooks</li> \r\n</ul>\r\n\r\n<p>Please forward your resume to Alan Kristmanson at <a href="mailto:alan@whistlergolf.com">alan@whistlergolf.com</a></p>', '2009-03-29 04:41:28', '2010-12-09 20:02:30', '', '', 0, '0000-00-00 00:00:00'),
(14, 'Passholder Booking Link', '', '2009-03-29 04:41:28', '2010-05-07 21:01:03', '', '', 0, '0000-00-00 00:00:00'),
(15, 'Passholder Confirmation Email', 'Thank you for purchasing a Seasons Pass at the Whistler Golf Club! Your Passholder''s web site can be found at whistlergolf.com in the bottom right hand side of the page. To access online booking please go to the passholder web site at 5pm the day before play Monday to Friday. Enter your email address and your password is your first name.\r\nIf you have any questions please call me directly at 604-932-3280.\r\n\r\nThank You\r\nChrista Langdon\r\nGuest Services Administrator\r\nWhistler Golf Club.', '2009-05-05 01:00:22', '2009-05-05 21:40:53', '', '', 0, '0000-00-00 00:00:00'),
(16, 'Signup Auto Reply Email', 'Thank you for joining the Whistler Golf Club EClub. You will receive Enews with special offers from the Whistler Golf Club throughout the season. As a thank you for joining we would like to offer you a two for one green fee coupon. Please print this page and bring it with you to the golf shop when you check in.', '2009-05-22 06:04:05', '2009-05-22 06:04:05', 'WGC328_GreenFee_Coupon.gif', 'image/gif', 17824, '2009-05-22 06:04:05');
