(28, 'Ann', 'Spence', NULL, 'ann@goldendreamswhistler.com', NULL, '604', '932.2667', 'Canada', NULL, NULL, '', '', '', '', NULL, '', '', NULL, NULL, NULL, '', 'Dear Staff/Management at Palmer''s Gallery:\r\nThanks AGAIN for honouring us with a complimentary dinner in return for sending so many of our Golden Dreams B&B guests to your establishment - was very delicious, along with ECEXELLENT service from (I beleive?) Jenn.\r\n\r\nFYI:  Here is recent comment posted by on of our pleased guests, on bedandbreakfast.com regarding your restaurant - keep up the good work!\r\n\r\n"Ann is very knowledgeable of the area & has lots of good advice on what to do & where to eat. Make sure to ask her where the daily dinner specials are in the village. WE TOOK HER ADVICE AND ATE AT THE GOLF COURSE.  THE MEAL WAS EXCELLENT AND WELL PRICED.  WHO WOULD HAVE THOUGHT OF THAT OTHER THAN A LOCAL? Our room was very comfortable & the breakfast excellent. Ann takes a lot of pride in her home, her town & her breakfasts.\r\n\r\nI will continue to forward my guests to your establishment, especially with comments like that!\r\nSincerely,\r\nAnn Spence\r\nHostess/Proprietor\r\n\r\n\r\n', '2009-08-05 20:42:31', '2009-08-05 20:42:31'),
