(32, 'Rob', 'Zopf', NULL, 'petersonzopf99@yahoo.com', NULL, '949', '635-9533', 'United States', NULL, NULL, '1 Danta', 'Rancho Santa Margarita', 'CA', '92688', NULL, 'July/August', '16+', NULL, NULL, NULL, '', 'I am in the process of organizing my annual buddies trip.  I am originally from Vancouver.  The group consists of people from Vancouver, California, Chicago, New Jersey, Australia.\r\n\r\nWe have played all over the US and Canada.  This will be our 9th trip.\r\n\r\nCan you please inform me of any special rates or other considerations for my group.\r\n\r\nThanks,\r\n\r\nRob.', '2009-12-10 23:04:30', '2009-12-10 23:04:30'),
