(36, 'Kevin ', 'Keith', NULL, 'keithkevin@hotmail.com', NULL, '011', '895-7700', 'Japan', NULL, NULL, 'atsubetsu chuo 3jo 2chome 13-36 2f', 'Sapporo', '', '004-0053', NULL, 'July 24th', '28', NULL, NULL, NULL, '', 'I have read your group outings info on the net and like what I see. Could you please let me know if this date is available with our first foursome teeing off between 9 and 11am. \r\nThank you very much,\r\nKevin Keith', '2010-02-15 06:05:00', '2010-02-15 06:05:00'),
