(43, 'tyler', 'wagner', NULL, 'countticklesin@hotmail.com', NULL, '604', '533-3366', 'Canada', NULL, NULL, '19804 40a', 'langley', 'bc', 'v3a7c2', NULL, 'june 12 2010', '12', NULL, NULL, NULL, '', 'i was wondering if there is a group rate for 12 people our golf group is golfing a couple of times on our way to whistler and our looking for best price posible per person with a cart would like to book asap!', '2010-04-14 15:13:15', '2010-04-14 15:13:15'),
(44, 'Andrew', 'Brine', NULL, 'abrine@harpergrey.com', NULL, '604', '895-2806', 'Canada', NULL, NULL, '3200 Vancouver Centre', 'Vancouver', 'BC', 'V6B 4P7', NULL, 'June 12, 2010', 'approximately 20-24', NULL, NULL, NULL, '', '', '2010-04-16 23:04:12', '2010-04-16 23:04:12'),
(45, 'Gerri', 'Ashby', NULL, 'gerri.ashby@fhr.com', NULL, '403', '716-7718', 'Canada', NULL, NULL, '1510, 111 - 5 Avenue SW', 'Calgary', 'AB', 'T2P 3Y6', NULL, 'Wed. June 23/10', '12', NULL, NULL, NULL, '', 'We would like to play 9 holes on June 23 @ 10:00am for 12 players.  Can I book this with you?\r\n\r\nthanks,', '2010-05-11 15:34:00', '2010-05-11 15:34:00'),
(46, 'Megan ', 'Tadeson ', NULL, 'megan@atlificseatosky.com', NULL, '604', '815-4903', 'Canada', NULL, NULL, '', 'Squamish ', 'BC ', '', NULL, 'July 12, 2010', '16', NULL, NULL, NULL, '', 'Hi, I am requesting group golfing cost information for a client. They are 16 players on July 12, 2010. \r\n\r\nThank you. ', '2010-05-19 16:48:41', '2010-05-19 16:48:41'),
(47, 'Praneel', 'Singh', NULL, 'praneelnsingh@shaw.ca', NULL, '778', '222-2676', 'Canada', NULL, NULL, '5894, 138th, Street', 'Surrey', 'BC', 'V3X 3P3', NULL, 'July 15th 2010', '4', NULL, NULL, NULL, '', 'Please contact me in regards to pricing for a group & availablity', '2010-05-27 03:00:58', '2010-05-27 03:00:58'),
(48, 'Phil', 'Leonard', NULL, 'pleonard@hkgdesign.com', NULL, '604', '602 7961', 'Canada', NULL, NULL, '110 - 1288 Chesterfield Avenue', 'North Vancouver', 'B.C.', 'V7M 0B1', NULL, 'September 11th 2010', '40 to 48', NULL, NULL, NULL, '', 'Hi, I book a tournament in Whistler every year and this year we would like to include Whistler Golf Club in our itinerary. Ideally the first tee time would be 11:00AM. Typically I have each player contact the venue with their own credit card information (well in advance of the date) and hopefully we can make similar arrangements with WGC. Please feel free to call me to discuss details, the best time to reach me at the above number is after 1:00PM.\r\nThank you\r\nPhil Leonard', '2010-05-27 21:40:38', '2010-05-27 21:40:38'),
(49, 'Eriko', 'Tatsuzaki', NULL, 'etatsuzaki@kiecan.com', NULL, '604', '638-9431', 'Canada', NULL, NULL, '910-1140 West Pender Street', 'Vancouver', 'BC', 'V6E 4G1', NULL, 'September 2, 2010', '16', NULL, NULL, NULL, '', 'Hello,\r\n\r\nMy name is Eriko from Kintetsu International Express Inc. which is a tour operator.\r\n\r\nThe name of group is "MAJESTY".  They will be staying at Hilton Whistler.  \r\n\r\nDo you provide a shuttle service from a hotel in Whistler village to your golf corse?  Please advise.\r\n\r\nBest regards,\r\n\r\nEriko Tatsuzaki', '2010-06-07 19:34:27', '2010-06-07 19:34:27'),
(50, 'Thomas', 'Snell', NULL, 'thomas.snell@mgccc.edu', NULL, '601', '5288952', 'United States', NULL, NULL, 'PO Box 316', 'Perkinston', 'MS', '39573', NULL, 'JUne/July 2011', '20', NULL, NULL, NULL, 'Richard Wight ', 'We''re a fun golf group looking for a place to spend 4 days playing golf in June/July.  Mainly couples, and the wife usually does not play golf.  ', '2010-06-15 13:18:44', '2010-06-15 13:18:44'),
(51, 'Dianne', 'Doerksen', NULL, 'ddoerksen@rsfeeds.net', NULL, '604', '859-7128', 'Canada', NULL, NULL, '33777 Enterprise Avenue', 'Abbotsford', 'BC', 'V2S 7T9', NULL, 'September 17, 2010', '16+', NULL, NULL, NULL, '', 'We have a management group coming to Whistler, arriving late morning of Sept 17th.  Would like to golf early afternoon.  \r\nCould possibly include lunch pre-golf for either the 16+ or up to 32 people.\r\nPlease let me know availability/rates/suggestions.\r\nthanks\r\nDianne\r\nRitchie-Smith Feeds, Inc.', '2010-06-29 18:54:55', '2010-06-29 18:54:55'),
(52, 'Jody', 'Elle', NULL, 'jodyelle@gmail.com', NULL, '604', '789-7568', 'Canada', NULL, NULL, '', '', '', '', NULL, 'Sept.12', '48', NULL, NULL, NULL, '', 'Hi:\r\n\r\nWe have an annual group event of golfers primarily from Pt Grey G&C.  We  have decided that Whistler works extremely well logistically so are coming there this year and in the future.  We would like info on arranging a shotgun (or modified shotgun) for Sat., Sept. 12 for around 10am.  There are 48 golfers in a play your on round, best 2 ball net.  We are used to playing an under 4 hour round as required by our course so would be a speedier group.\r\n\r\nWe do not need any organized F&B although many would come for breakfast first and all would stay for drinks, etc after.  Please let me know if you can accomodate us?  Also quote for golf as well as golf and cart package.  We are staying at the Chateau and golfing there on the Sunday as it is a 2 day tournie.\r\n\r\nRegards,\r\nJody Elle', '2010-07-05 19:45:31', '2010-07-05 19:45:31'),
(53, 'Norma', 'Thompson', NULL, 'norma@techie.com', NULL, '306', '934 0098', 'Canada', NULL, NULL, '226 Zeman Court', 'Saskatoon', 'SK', 'S7K 7W5', NULL, 'August 13th', '16', NULL, NULL, NULL, '', 'My daughter is getting married in Whistler on the 14th and we thought we''d set up a golf game for interested guests.  Many are coming from New Zealand and would need to rent clubs.  I suspect most of the 16 would need clubs.  Can you accomodate club rental for that many? Could you please give me the cost of that as well as the group rate.  I''m not sure of exact numbers at this point, but it would be 16 to 20.  Also need cart rental price.  Thanks.', '2010-07-06 14:34:59', '2010-07-06 14:34:59'),
(54, 'Shea', 'Dahl', NULL, 'programs@ams.ubc.ca', NULL, '604', '2183157', 'Canada', NULL, NULL, '266 - 6138 Student Union Blvd', 'Vancouver', 'B.C.', 'V6T 1Z1', NULL, 'June 20, 2011', '36-48', NULL, NULL, NULL, '', 'Annual event as part of national conference - group booked into the Westin. Would be looking for first group to see off around 10am.\r\n\r\nI will be up in Whistler M-W of next week and would appreciate the chance to see the facilities while up there.  ', '2010-07-21 21:10:43', '2010-07-21 21:10:43'),
(55, 'Troy ', 'Palmer', NULL, 'troypalmer10@hotmail.com', NULL, '250 368-3530', '250 368-3530', 'Canada', NULL, NULL, '', 'Trail', 'B.C.', 'V1R 2R4', NULL, 'Sept 18', '16', NULL, NULL, NULL, '', 'I am planing my brothers stag and I am interested in golfing at your course. I was just wondering what kind of rates you can give me. \r\nThanks,\r\nTroy', '2010-08-11 02:02:44', '2010-08-11 02:02:44'),
(56, 'glenn', 'wong', NULL, 'glwong@telus.net', NULL, '250', '724-4847        cell 250-731-4847', 'Canada', NULL, NULL, '6152 cottam rd. ', 'port alberni', 'b.c.', 'v9y 8r7', NULL, '9-27-2010  1;00 p.m.', '4-8', NULL, NULL, NULL, 'self', '  attending  u.b.c.m. convention. van. island mayors and politicans .would love to play whistler course . tee time is important as many of us have time constraints . please call me back with confirmation and green fees.    cheers. glenn wong ', '2010-08-31 05:51:17', '2010-08-31 05:51:17'),
(57, 'Scott', 'Locken', NULL, 'scott.locken@surewood.ca', NULL, '604', '996-7788', 'Canada', NULL, NULL, '984 Corona Cres.', 'Coquitlam', 'B.C.', 'V3J 6Y9', NULL, 'July 16, 2010', '48', NULL, NULL, NULL, 'Myself', 'This was an over 30''s soccer team and friends now in their 20th year together going golfing in different areas around the province. We play a 4 man scramble format, very respectful of golf clubs and courses but like to have a few beers during the round. All need power carts and the 19th hole BBQ would be good. Thank you.', '2010-09-02 15:34:41', '2010-09-02 15:34:41'),
(58, 'Aaron', 'Nauth', NULL, 'aaron.nauth@utoronto.ca', NULL, '778', '919-9395', 'Canada', NULL, NULL, '', '', '', '', NULL, 'Friday May 20th', '20 ', NULL, NULL, NULL, '', 'Hi there!\r\n    I am getting married in Whistler on Saturday May 21st, 2011 and was looking at having a round of golf with the guys the Friday before. My fiance Rhonda Jamieson spoke earlier this year with Suzy Downing regarding weddings and a golf tournament, and although we have booked our wedding elsewhere, we were hoping to arrange something with you for a golf tourney and possible BBQ on the Friday evening for all our guests. Feel free to contact me over the phone or email if that is more convenient. Thank you for your time, I look forward to speaking with you. \r\nSincerely,\r\nAaron Nauth', '2010-11-02 03:16:16', '2010-11-02 03:16:16'),
(59, 'Lyndsy', 'Miceli', NULL, 'lmiceli@ecao.org', NULL, '416', '675-3226', 'Canada', NULL, NULL, '170 Attwell Drive, Suite 460', 'Maple', 'Ontario', 'M9W 5Z5', NULL, 'Wednesday June 13, 2012', 'N/A', NULL, NULL, NULL, '', 'Ro, \r\n\r\nI am so sorry for the delay in my reply back to you. I wanted to thank you for showing us your course in late November. \r\n\r\nI would love if you could send me your tournament pricing if you can electronically (please include a breakfast and lunch in the package and outline whatever else is included in your pricing). \r\n\r\nIf you could also check availability for Wednesday June 13, 2012 (not sure how many delegates we will have participating, however, I believe during our meeting with you, you mention there was no minimum for a shotgun, please confirm). \r\n\r\nLooking forward to hearing from you soon, \r\n\r\nHappy Holidays, \r\n', '2010-12-21 19:49:50', '2010-12-21 19:49:50');
INSERT INTO `holes` (`id`, `number`, `par`, `tournament_tees`, `palmer_tees`, `white_tees`, `forward_tees`, `handicap_mens`, `handicap_womens`, `description`, `created_at`, `updated_at`, `image_file_name`, `image_content_type`, `image_file_size`, `name`) VALUES
(1, 1, 4, 380, 360, 340, 340, 9, 7, 'This hole favours a left to right tee shot. The hooked or pulled shot will leave you with a tough shot around the huge hemlock that stands left of this undulating green.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Cedar Grove'),
(2, 2, 4, 471, 410, 362, 320, 3, 11, 'The tee shot landing area is guarded left and right by bunkers. Watch out for the large spruce on the right side 80 yards short of the green. Bunkers right and back protect this green.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Double Trouble'),
(3, 3, 5, 552, 537, 493, 466, 1, 1, 'From tee to green, right is jail. Left center off the tee is ideal. From this point the hole doglegs sharply right around the corner. Don''t miss this green long.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Hairpin'),
(4, 4, 4, 301, 301, 280, 256, 17, 15, 'This short par 4 will tempt many to drive the green, however the rise in front of the tee hides a narrow fairway and a creek down the entire right side.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Easy Does It'),
(5, 5, 3, 233, 211, 211, 166, 7, 13, 'The wind will play a big role in club selection as it is usually in your face. 5 usually requires a wood to reach the green which is no bargain itself. Stay below the hole!', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Whistler Bowl'),
(6, 6, 4, 370, 370, 355, 332, 13, 5, 'The ideal position off the tee is right centre but be careful of the two fir trees. Beware of water behind the green as this hole usually plays downwind.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Groomer''s Choice'),
(7, 7, 4, 384, 363, 363, 321, 11, 9, 'Any tee shot to the right here will catch the creek. Hit something about 200 yards at the left centre of the fairway. On your second shot take enough club to clear right front trap. Another tough green. This is a classic short par 4.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Deception Pass'),
(8, 8, 3, 188, 161, 161, 119, 15, 17, 'Trouble short and right. No kidding! Watch tier in centre of green. Do not be above the hole. I repeat, do not be above the hole.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Singing Cedars'),
(9, 9, 5, 527, 478, 478, 417, 5, 3, 'A straight away par 5. Crabapple creek guards the entire right side. If the wind is down and you rip a drive, eagle is a possibility.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Rainbow''s Run'),
(10, 10, 4, 334, 326, 301, 286, 14, 14, 'Another classic short par 4. This dogleg right is guarded by a lake left and Crabapple creek which lines the right side and cuts in front of the green. Maybe the toughest second shot on the course. Take two more clubs when the wind is up.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Windtalker'),
(11, 11, 5, 515, 486, 486, 415, 8, 2, 'Unless you kill a drive, going for the green in two isn''t worth it. Aim left centre off the tee and hit an iron between the two creeks. This will leave you anywhere from 110-160 yards in. Four bunkers guard another tough green.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Arnie''s Eagle'),
(12, 12, 4, 431, 409, 378, 328, 4, 6, 'A left to right tee shot is required here. Check wind. When it''s behind you the second shot plays much shorter than yardage.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Fade Away'),
(13, 13, 4, 404, 391, 358, 348, 6, 4, 'Anything left of the tee is in bear country. Stay to the right side of the fairway off the tee for a better angle to the green. A beautiful view of Blackcomb Mountain awaits your second shot. Par is a great score.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Bear Island'),
(14, 14, 3, 181, 160, 150, 135, 18, 18, 'This tee shot usually requires an extra club. Watch out for the tier that runs diagonally through the green.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Peak Peek'),
(15, 15, 4, 385, 361, 352, 293, 12, 12, 'Aim left centre here to avoid take left and creek and O.B. right. Again, wind in your face and a tier that runs right across the middle of the green. Check flag position.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'The Lodge'),
(16, 16, 4, 460, 450, 450, 332, 2, 8, 'What a view! A good tee shot gives you a chance to hit the green in two. Be careful, this green is very well guarded by water and sand.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'The Gallery'),
(17, 17, 3, 181, 169, 150, 138, 16, 16, 'This narrow green is guarded left and right by bunkers. Check flag position as this green is very long.	', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Bird Bath'),
(18, 18, 4, 425, 393, 336, 336, 10, 10, 'A beautiful finishing hole with Mt Currie as your backdrop. A good tee shot is needed to avoid lake and fairway trap. Biggest green on course yields numerous three putts.', '2009-03-04 06:04:31', '2009-03-08 04:13:10', NULL, NULL, NULL, 'Last Run');
