(22, 'Marliss', 'Thiessen', NULL, NULL, 'thiessen.m@novuscom.net', NULL, NULL, '#1005-283 Davie Street', 'Vancouver', 'BC', 'Canada', 'Cell', '604', '861-2884', NULL, '2010-05-23', '2010-05-21', 'PM', 'Hi Whistler Course,\r\n\r\nIt''s Marliss and Brian Thiessen here. You know us by our early golf bookings at 6 & 7 A.M.  Just golfed with you this morning even.  We are planning to throw ourselves a 25th Anniversary Party for next year and thought it only appropriate that we hold it at our favorite place to golf.:) We are planning a very small venue with immediate family members and a close friends.  We will probably have 20-25 people in total.  Also, the morning of the event we may want to plan a small golf tournament for our family/friends too if this is possible.  Let me know about availability on the Victoria Day long weekend.  Thanks so much for your help.\r\nMarliss (& Brian) Thiessen\r\n(Cell)604-861-2884 - Usually the best # to reach me at\r\n(Work)604-875-5352\r\n(Home)604-899-4256\r\n\r\n', '2009-06-08 04:28:26', '2009-06-08 04:28:26'),
(23, 'Alfonso', 'Torres', NULL, NULL, 'info@alavista.ca', NULL, NULL, 'Burnaby', '', '', 'Canada', 'Cell', '778', '239 18 11', NULL, '2009-06-08', '2009-06-08', NULL, 'Professional Floral Decoration Services $20.00/hour, Auction prices flower sale.\r\n\r\nBuy from your prefered flower wholesaler and leave the decoration to us, or  let us get the best price and the freshest flowers buying them for you at the United Flower Growers Auction, 6 AM Monday, Tuesday and Thursday.\r\n\r\n\r\nVisit our website for more information: www.alavista.ca\r\n\r\nRegards,\r\n\r\nLuciana Magalhaes\r\nProfessional Floral Designer\r\n\r\nmail: info@alavista.ca\r\n\r\nph. 604-288-4049\r\ncell 778-239-1811\r\n\r\n', '2009-06-08 20:20:14', '2009-06-08 20:20:14'),
