(27, 'Brian', 'Hughes', NULL, NULL, 'BHughes@nhc-van.com', NULL, NULL, '', '', '', 'Canada', 'Office', '604', '980-6011', NULL, '2009-08-07', '2009-07-06', 'PM', 'We are having our company meeting at Whistler and would like to have a BBQ-style dinner on the evening of Aug 7th for approximately 65 adults and 20-30 children. Is this date available? What are the pricing options? Can you also supply drinks? Please call or e-mail.', '2009-07-06 22:18:10', '2009-07-06 22:18:10'),
(28, 'Shelby', 'Garis', NULL, NULL, 'shelbygaris@yahoo.com', NULL, NULL, '19471 Thorburn Way', 'Pitt Meadows ', 'BC', 'Canada', 'Cell', '604', '307-9530', NULL, '2010-08-14', '2010-08-21', NULL, 'Hi there,\r\n\r\nI am recently engaged (this past weekend actually!) and am interested in available Saturday dates for the summer of 2010. I am not specific to any date really, but would prefer a Saturday in July or August. I am asking now as we are leaving for a month long trip to Africa in 3 weeks and am thinking that we should probably enquire availability now before we go.\r\n\r\nThanks in advance!\r\n\r\nShelby Garis\r\nMike Bruce', '2009-09-04 11:39:50', '2009-09-04 11:39:50'),
(29, 'Ian', 'Turner', NULL, NULL, 'ianmturner@sympatico.ca', NULL, NULL, '2371 North Ridge Trail', 'Oakville', 'ON', 'Canada', 'Home', '905', '2578212', NULL, '2010-07-30', '2010-07-31', 'PM', 'We are looking to host a small wedding of about 20 people (adults and children) at WGC. I''ve read your brochure and have a number of questions for you. We also are looking for accomodations so would like to know if you have a preferred hotel/condo that would offer us preferred rates. Note that all guests will require accomodations for likely 3 nights each.  FYI, I left a voicemail for the Events Coord. Monday morning and am still awaiting her response so would appreciate a quick response, phone call please. Thanks\r\n\r\nIan', '2009-09-24 21:36:38', '2009-09-24 21:36:38'),
