(32, 'Tricia', 'Heywood', NULL, NULL, 'theywood@stratwestcommunications.com ', NULL, NULL, '', '', '', 'Canada', 'Cell', '778', '896 9465', NULL, '2010-03-13', '2009-12-28', NULL, 'Hello,\r\n\r\nI am looking for options to host a dinner for approx. 45ppl.  March 13th, 2010. I wanted to enquire about the possibility of holding a dinner of this size at the Golf Club – I believe the capacity is 60. If 45 ppl is suitable, and you have availability on March 13th, can you send me some menu options? I looked at your brochure and thought that something like The Blackcomb menu option would be appropriate.  \r\n\r\nThe dinner is for the Canadian Paralympic Committee – board members and sponsors and may include a handful of children. \r\n\r\nThanks for your assistance,\r\n\r\nTricia Heywood\r\n778 896 9465\r\n\r\n', '2009-12-28 21:06:14', '2009-12-28 21:06:14'),
(33, 'Karen', 'Clark', NULL, NULL, 'karen@blinkinteractive.com', NULL, NULL, '2848 NW 66th st', 'Seattle', 'WA', 'United States', 'Cell', '206', '595-2862', NULL, '2010-05-15', '2010-01-01', 'PM', 'Hello!\r\nWe are interested in having our wedding ceremony at your "knoll" and our reception following in your facility. Do you have availability on Sat, May 15?\r\nWe will have a large crowd. On your website you mention it''s possible to accommodate more than 150 people. We will likely have closer to 200, however 40 of them will be kids. If our date and our size are possible please let me know who to call and when for more details.\r\nThank you!\r\nKaren Clark', '2010-01-01 19:00:44', '2010-01-01 19:00:44'),
