(36, 'Kevin', 'Loong', NULL, NULL, 'loonger@hotmail.com', NULL, NULL, '#217-801 Klahanie Drive', 'Port Moody', '', 'Canada', 'Cell', '604', '6261145', NULL, '2010-11-20', '2010-09-25', 'PM', 'Hi there,  I managed to read and view your wedding package and am very interested in hearing more about holding our wedding at your venue.  I had a few questions: \r\n1) Do you accomodate outside catering?\r\n2) What are the rental fees of the venue?\r\n3) How many can you accomodate during November 2010?  I noticed you only have 60 ppl indoor but would having people on the outside patio ok during November?\r\nThank you!', '2010-01-29 03:27:06', '2010-01-29 03:27:06'),
(37, 'Rhonda', 'Jamieson', NULL, NULL, 'jamieson.rhonda@gmail.com', NULL, NULL, '#602-96 St Patrick Street, Toronto, Ontario', '', '', 'Canada', 'Cell', '416', '527-3947', NULL, '2011-05-21', '2011-05-22', NULL, 'Hi I was interested in obtaining more information on your golf course for my wedding. We are looking to have around 120 guests, so it would have to be in the marquee tent outside. As well is the only option for the ceremony on the grassy knoll? Any info you could provide would be greatly appreciated. Sincerely, Rhonda Jamieson', '2010-02-03 02:23:32', '2010-02-03 02:23:32'),
(38, 'Susan', 'Patterson', NULL, NULL, 'susan@nomoredebts.org', NULL, NULL, '330 - 435 Columbia St.', '', '', 'Canada', 'Office', '604', '636-0232', NULL, '2010-06-13', '2010-02-24', NULL, 'Hello,\r\nCredit Counselling Canada is holding a small conference in Whistler June 13 - June 15.  \r\n\r\nWe would like to host a dinner for roughly 40 people.  Could you please advise what may be available at the local golf courses (or should I contact each one separately)?  \r\n\r\nI would like information on menu options, price per person, wine lists and of course whether or not we could be accommodated.\r\n\r\nThank you,\r\nSusan\r\n\r\n', '2010-02-24 00:56:31', '2010-02-24 00:56:31'),
